CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_accept_offer_v7` (IN `p_offer_id` BIGINT UNSIGNED)   accept_flow: BEGIN
  DECLARE v_tenant_id   BIGINT UNSIGNED;
  DECLARE v_ride_id     BIGINT UNSIGNED;
  DECLARE v_driver_id   BIGINT UNSIGNED;
  DECLARE v_vehicle_id  BIGINT UNSIGNED;
  DECLARE v_offer_status VARCHAR(32);
  DECLARE v_expires     DATETIME;

  DECLARE v_curr_ride_status VARCHAR(32);
  DECLARE v_curr_ride_driver BIGINT UNSIGNED;

  DECLARE v_prev_status VARCHAR(32);
  DECLARE v_origin_lat DOUBLE;
  DECLARE v_origin_lng DOUBLE;

  DECLARE v_has_active INT DEFAULT 0;

  DECLARE v_last_pos INT DEFAULT 0;
  DECLARE v_next_pos INT DEFAULT 1;

  
  DECLARE v_economico  VARCHAR(64);
  DECLARE v_plate      VARCHAR(64);
  DECLARE v_dlat DOUBLE; DECLARE v_dlng DOUBLE;

  DECLARE v_stand_id BIGINT UNSIGNED;
  DECLARE v_stand_name VARCHAR(128);
  DECLARE v_radius_km DOUBLE;
  DECLARE v_stand_dist_km DOUBLE;

  DECLARE _nf INT DEFAULT 0;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET _nf = 1;

  START TRANSACTION;

  
  SET _nf = 0;
  SELECT ro.tenant_id, ro.ride_id, ro.driver_id, ro.vehicle_id, ro.status, ro.expires_at
    INTO v_tenant_id, v_ride_id, v_driver_id, v_vehicle_id, v_offer_status, v_expires
  FROM ride_offers ro
  WHERE ro.id = p_offer_id
  FOR UPDATE;

  IF _nf = 1 OR v_ride_id IS NULL OR v_driver_id IS NULL THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Offer inexistente/ inválida';
  END IF;

  
  IF v_offer_status = 'accepted' THEN
    COMMIT;
    SELECT 'activated' AS mode, v_tenant_id AS tenant_id, v_ride_id AS ride_id, p_offer_id AS offer_id,
           v_driver_id AS driver_id, NULL AS queued_position;
    LEAVE accept_flow;
  END IF;

  IF v_offer_status = 'queued' THEN
    COMMIT;
    SELECT 'queued' AS mode, v_tenant_id AS tenant_id, v_ride_id AS ride_id, p_offer_id AS offer_id,
           v_driver_id AS driver_id, NULL AS queued_position;
    LEAVE accept_flow;
  END IF;

  IF v_offer_status <> 'offered' THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Offer no está en offered';
  END IF;

  IF v_expires IS NOT NULL AND v_expires < NOW() THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Offer expirada';
  END IF;

  
  SET _nf = 0;
  SELECT r.status, r.driver_id, r.origin_lat, r.origin_lng
    INTO v_curr_ride_status, v_curr_ride_driver, v_origin_lat, v_origin_lng
  FROM rides r
  WHERE r.id = v_ride_id AND r.tenant_id = v_tenant_id
  FOR UPDATE;

  IF _nf = 1 THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride inexistente';
  END IF;

  SET v_prev_status = v_curr_ride_status;

  
  SELECT EXISTS(
    SELECT 1
    FROM rides r
    WHERE r.tenant_id = v_tenant_id
      AND r.driver_id = v_driver_id
      AND r.id <> v_ride_id
      AND r.status IN ('accepted','en_route','arrived','on_board')
    LIMIT 1
  ) INTO v_has_active;

  
  IF v_has_active = 1 THEN

    SET _nf = 0;
    SELECT COALESCE(queued_position, 0)
      INTO v_last_pos
    FROM ride_offers
    WHERE tenant_id = v_tenant_id
      AND driver_id = v_driver_id
      AND status    = 'queued'
    ORDER BY queued_position DESC, id DESC
    LIMIT 1
    FOR UPDATE;

    IF _nf = 1 THEN SET v_last_pos = 0; END IF;
    SET v_next_pos = v_last_pos + 1;

    UPDATE rides
       SET driver_id  = COALESCE(driver_id, v_driver_id),
           vehicle_id = COALESCE(v_vehicle_id, vehicle_id),
           status     = 'queued',
           updated_at = NOW()
     WHERE id        = v_ride_id
       AND tenant_id = v_tenant_id
       AND status IN ('requested','offered','scheduled','queued')
       AND (driver_id IS NULL OR driver_id = v_driver_id);

    IF ROW_COUNT() = 0 THEN
      ROLLBACK;
      SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no encolable (estado/driver mismatch)';
    END IF;

    UPDATE ride_offers
       SET status          = 'queued',
           response        = 'accepted',
           responded_at    = NOW(),
           queued_at       = NOW(),
           queued_position = v_next_pos,
           queued_reason   = 'has_active',
           updated_at      = NOW()
     WHERE id = p_offer_id
       AND status = 'offered';

    UPDATE ride_offers
       SET responded_at = COALESCE(responded_at, NOW()),
           response     = COALESCE(response, 'rejected'),
           status       = CASE WHEN status='offered' THEN 'rejected' ELSE status END,
           updated_at   = NOW()
     WHERE tenant_id = v_tenant_id
       AND ride_id   = v_ride_id
       AND id       <> p_offer_id
       AND status    = 'offered';

    
       JSON_OBJECT(
         'offer_id', p_offer_id,
         'driver_id', v_driver_id,
         'vehicle_id', v_vehicle_id,
         'queued_position', v_next_pos,
         'queued_reason', 'has_active'
       ),
       NOW());

    COMMIT;

    SELECT 'queued' AS mode, v_tenant_id AS tenant_id, v_ride_id AS ride_id, p_offer_id AS offer_id,
           v_driver_id AS driver_id, v_next_pos AS queued_position;

    LEAVE accept_flow;
  END IF;

  
  UPDATE rides
     SET driver_id   = COALESCE(driver_id, v_driver_id),
         vehicle_id  = COALESCE(v_vehicle_id, vehicle_id),
         status      = CASE
                         WHEN v_curr_ride_status IN ('requested','offered','scheduled','queued')
                           THEN 'accepted'
                         ELSE v_curr_ride_status
                       END,
         accepted_at = COALESCE(accepted_at, NOW()),
         updated_at  = NOW()
   WHERE id        = v_ride_id
     AND tenant_id = v_tenant_id
     AND (driver_id IS NULL OR driver_id = v_driver_id);

  IF ROW_COUNT() = 0 THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no activable (race/estado/driver mismatch)';
  END IF;

  UPDATE ride_offers
     SET status       = 'accepted',
         response     = 'accepted',
         responded_at = NOW(),
         updated_at   = NOW()
   WHERE id = p_offer_id
     AND status IN ('offered','queued');

  UPDATE ride_offers
     SET responded_at = COALESCE(responded_at, NOW()),
         response     = COALESCE(response, 'rejected'),
         status       = CASE WHEN status='offered' THEN 'rejected' ELSE status END,
         updated_at   = NOW()
   WHERE ride_id   = v_ride_id
     AND tenant_id = v_tenant_id
     AND id       <> p_offer_id;

  
  SELECT v.economico, v.plate
    INTO v_economico, v_plate
  FROM vehicles v
  WHERE v.id = COALESCE(v_vehicle_id, (SELECT vehicle_id FROM rides WHERE id=v_ride_id LIMIT 1))
  LIMIT 1;

  SELECT d.last_lat, d.last_lng
    INTO v_dlat, v_dlng
  FROM drivers d
  WHERE d.id = v_driver_id
  LIMIT 1;

SET v_stand_id = NULL; SET v_stand_name = NULL; SET _nf = 0;

SELECT q.stand_id, ts.nombre
  INTO v_stand_id, v_stand_name
FROM taxi_stand_queue q
JOIN taxi_stands ts
  ON ts.id = q.stand_id
 AND ts.tenant_id = q.tenant_id
WHERE q.tenant_id = v_tenant_id
  AND q.driver_id = v_driver_id
  AND q.status IN ('en_cola','saltado')
ORDER BY q.id DESC
LIMIT 1
FOR UPDATE;

IF _nf = 1 THEN
  SET v_stand_id = NULL;
END IF;

IF v_stand_id IS NOT NULL THEN
  CALL sp_queue_leave_stand_v1(v_tenant_id, v_stand_id, v_driver_id, 'asignado');
END IF;


  
     JSON_OBJECT(
       'offer_id', p_offer_id,
       'driver_id', v_driver_id,
       'vehicle_id', v_vehicle_id,
       'economico', v_economico,
       'plate', v_plate,
       'driver_last_lat', v_dlat,
       'driver_last_lng', v_dlng,
       'stand_id_on_accept', v_stand_id,
       'stand_name_on_accept', v_stand_name,
       'stand_dist_km', v_stand_dist_km
     ),
     NOW());

  COMMIT;

  SELECT 'activated' AS mode, v_tenant_id AS tenant_id, v_ride_id AS ride_id, p_offer_id AS offer_id,
         v_driver_id AS driver_id, NULL AS queued_position;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_assign_direct_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED)   BEGIN
  DECLARE v_vehicle_id BIGINT UNSIGNED;
  DECLARE v_driver_status VARCHAR(10);

  IF NOT EXISTS (
    SELECT 1 FROM rides r
     WHERE r.id = p_ride_id
       AND r.tenant_id = p_tenant_id
       AND r.driver_id IS NULL
       AND r.status IN ('requested','offered')  
     LIMIT 1
  ) THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no ofertable o ya asignado';
  END IF;

  SELECT d.status
    INTO v_driver_status
  FROM drivers d
  WHERE d.id = p_driver_id
    AND d.tenant_id = p_tenant_id
    AND d.last_lat IS NOT NULL
    AND d.last_lng IS NOT NULL
  LIMIT 1;

  IF v_driver_status IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver inexistente o sin coordenadas';
  END IF;
  IF v_driver_status <> 'idle' THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver no está idle';
  END IF;

  SELECT s.vehicle_id
    INTO v_vehicle_id
  FROM driver_shifts s
  WHERE s.driver_id = p_driver_id
    AND s.tenant_id = p_tenant_id
    AND s.status = 'abierto'
  ORDER BY s.id DESC
  LIMIT 1;

  IF v_vehicle_id IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver sin shift abierto/vehículo';
  END IF;

  UPDATE rides
     SET driver_id  = p_driver_id,
         vehicle_id = COALESCE(v_vehicle_id, vehicle_id),
         status     = 'accepted'
   WHERE id = p_ride_id
     AND tenant_id = p_tenant_id
     AND driver_id IS NULL
     AND status IN ('requested','offered','queued');   

  IF ROW_COUNT() = 0 THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No se pudo asignar (carrera de estado)';
  END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_autodispatch_tick_v2` (IN `p_tenant_id` BIGINT UNSIGNED)   tick_flow: BEGIN
  DECLARE v_offer_expires INT DEFAULT 60;
  DECLARE v_wave_n        INT DEFAULT 3;
  DECLARE v_lead_min      INT DEFAULT 5;
  DECLARE v_radius_km     DOUBLE DEFAULT 5.00;

  
  SELECT
    COALESCE(ds.offer_expires_sec,60),
    COALESCE(ds.wave_size_n,3),
    COALESCE(ds.lead_time_min,5),
    COALESCE(ds.auto_dispatch_radius_km,5.00)
  INTO v_offer_expires, v_wave_n, v_lead_min, v_radius_km
  FROM (SELECT 1) x
  LEFT JOIN dispatch_settings ds
    ON ds.tenant_id = p_tenant_id
  LIMIT 1;

  DROP TEMPORARY TABLE IF EXISTS tmp_autod_rides;
  CREATE TEMPORARY TABLE tmp_autod_rides (
    ride_id BIGINT UNSIGNED PRIMARY KEY
  ) ENGINE=MEMORY;

  
  SELECT r.id
  FROM rides r
  WHERE r.tenant_id = p_tenant_id
    AND r.driver_id IS NULL
    AND r.status IN ('requested','offered','scheduled')
    AND r.scheduled_for IS NOT NULL
    AND r.scheduled_for BETWEEN NOW() AND DATE_ADD(NOW(), INTERVAL v_lead_min MINUTE)
  LIMIT 50;

  
  SELECT r.id
  FROM rides r
  WHERE r.tenant_id = p_tenant_id
    AND r.driver_id IS NULL
    AND r.status IN ('requested','offered','scheduled')
    AND r.scheduled_for IS NULL
    AND TIMESTAMPDIFF(MINUTE, r.created_at, NOW()) <= 10
  LIMIT 50;

  
  CALL sp_expire_offers_v2(p_tenant_id);

  BEGIN
    DECLARE v_ride_id BIGINT UNSIGNED;
    DECLARE done INT DEFAULT 0;

    DECLARE cur_rides CURSOR FOR
      SELECT ride_id FROM tmp_autod_rides ORDER BY ride_id;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur_rides;

    read_loop: LOOP
      FETCH cur_rides INTO v_ride_id;
      IF done = 1 THEN LEAVE read_loop; END IF;

      
      IF (SELECT driver_id
          FROM rides
          WHERE tenant_id = p_tenant_id AND id = v_ride_id
          LIMIT 1) IS NOT NULL THEN
        ITERATE read_loop;
      END IF;

      
      IF (SELECT COUNT(*)
          FROM ride_offers
          WHERE tenant_id=p_tenant_id AND ride_id=v_ride_id AND status='accepted') > 0 THEN
        ITERATE read_loop;
      END IF;

      
      IF EXISTS (
        SELECT 1
        FROM ride_offers
        WHERE tenant_id = p_tenant_id
          AND ride_id   = v_ride_id
          AND status    = 'offered'
          AND responded_at IS NULL
          AND (expires_at IS NULL OR expires_at > NOW())
        LIMIT 1
      ) THEN
        ITERATE read_loop;
      END IF;

      
      CALL sp_offer_wave_prio_v3(
        p_tenant_id,
        v_ride_id,
        v_radius_km,
        v_wave_n,
        v_offer_expires
      );

    END LOOP;

    CLOSE cur_rides;
  END;

  DROP TEMPORARY TABLE IF EXISTS tmp_autod_rides;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_autodispatch_tick_v3` (IN `p_tenant_id` BIGINT UNSIGNED)   BEGIN
  CALL sp_autodispatch_tick_v2(p_tenant_id);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cancel_ride_v2` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_canceled_by` VARCHAR(32), IN `p_reason` TEXT)   can_flow: BEGIN
  DECLARE v_prev_status VARCHAR(32);
  DECLARE v_driver_id BIGINT UNSIGNED;
  DECLARE v_vehicle_id BIGINT UNSIGNED;

  DECLARE v_by_lc VARCHAR(32);
  DECLARE v_by_norm VARCHAR(32);

  DECLARE v_economico VARCHAR(64);
  DECLARE v_plate VARCHAR(64);

  
  DECLARE v_next_offer_id BIGINT UNSIGNED;
  DECLARE v_next_ride_id  BIGINT UNSIGNED;
  DECLARE v_next_vehicle_id BIGINT UNSIGNED;

  DECLARE _nf INT DEFAULT 0;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET _nf = 1;

  START TRANSACTION;

  
  SET _nf = 0;
  SELECT r.status, r.driver_id, r.vehicle_id
    INTO v_prev_status, v_driver_id, v_vehicle_id
  FROM rides r
  WHERE r.tenant_id=p_tenant_id AND r.id=p_ride_id
  FOR UPDATE;

  IF _nf = 1 THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT='Ride inexistente o de otro tenant';
  END IF;

  IF v_prev_status NOT IN ('requested','offered','scheduled','queued','accepted','en_route','arrived','on_board') THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT='Ride no cancelable en su estado actual';
  END IF;

  SET v_by_lc = LOWER(TRIM(COALESCE(p_canceled_by,'')));
  SET v_by_norm = CASE
    WHEN v_by_lc IN ('dispatch','ops','operator') THEN 'dispatch'
    WHEN v_by_lc IN ('driver','conductor') THEN 'driver'
    WHEN v_by_lc IN ('passenger','cliente','rider') THEN 'passenger'
    WHEN v_by_lc IN ('system','sistema') THEN 'system'
    ELSE 'dispatch'
  END;

  SELECT v.economico, v.plate
    INTO v_economico, v_plate
  FROM vehicles v
  WHERE v.id = v_vehicle_id
  LIMIT 1;

  
  UPDATE rides
     SET status='canceled',
         canceled_at=NOW(),
         canceled_by=v_by_norm,
         cancel_reason=NULLIF(TRIM(COALESCE(p_reason,'')),''),
         updated_at=NOW()
   WHERE tenant_id=p_tenant_id AND id=p_ride_id;

  
  UPDATE ride_offers
     SET responded_at=COALESCE(responded_at,NOW()),
         response='canceled',
         status='canceled',
         updated_at=NOW()
   WHERE tenant_id=p_tenant_id AND ride_id=p_ride_id
     AND status IN ('offered','accepted','queued');

  VALUES (
    p_tenant_id, p_ride_id, v_prev_status, 'canceled',
    JSON_OBJECT(
      'canceled_by', v_by_norm,
      'reason', NULLIF(TRIM(COALESCE(p_reason,'')),''),
      'economico', v_economico,
      'plate', v_plate,
      'driver_id', v_driver_id,
      'vehicle_id', v_vehicle_id
    ),
    NOW()
  );

  
  IF v_driver_id IS NULL THEN
    COMMIT;
    SELECT 'canceled' AS mode, NULL AS next_ride_id, NULL AS next_offer_id;
    LEAVE can_flow;
  END IF;

  
  SET _nf = 0;
  SELECT o.id, o.ride_id, o.vehicle_id
    INTO v_next_offer_id, v_next_ride_id, v_next_vehicle_id
  FROM ride_offers o
  JOIN rides r
    ON r.id=o.ride_id AND r.tenant_id=o.tenant_id
  WHERE o.tenant_id=p_tenant_id
    AND o.driver_id=v_driver_id
    AND o.status='queued'
    AND r.status='queued'
    AND (r.driver_id IS NULL OR r.driver_id=v_driver_id)
  ORDER BY COALESCE(o.queued_position,999999) ASC,
           COALESCE(o.queued_at,o.created_at) ASC,
           o.id ASC
  LIMIT 1
  FOR UPDATE;

  IF _nf = 1 OR v_next_ride_id IS NULL THEN
    
    UPDATE drivers
       SET status='idle', updated_at=NOW()
     WHERE tenant_id=p_tenant_id AND id=v_driver_id;

    COMMIT;
    SELECT 'canceled' AS mode, NULL AS next_ride_id, NULL AS next_offer_id;
    LEAVE can_flow;
  END IF;

  
  UPDATE rides
     SET driver_id   = COALESCE(driver_id, v_driver_id),
         vehicle_id  = COALESCE(vehicle_id, v_next_vehicle_id),
         status      = 'accepted',
         accepted_at = COALESCE(accepted_at, NOW()),
         updated_at  = NOW()
   WHERE tenant_id=p_tenant_id
     AND id=v_next_ride_id
     AND status IN ('requested','offered','scheduled','queued')
     AND (driver_id IS NULL OR driver_id=v_driver_id);

  IF ROW_COUNT() = 0 THEN
    
    UPDATE drivers
       SET status='idle', updated_at=NOW()
     WHERE tenant_id=p_tenant_id AND id=v_driver_id;

    COMMIT;
    SELECT 'canceled' AS mode, NULL AS next_ride_id, NULL AS next_offer_id;
    LEAVE can_flow;
  END IF;

  UPDATE ride_offers
     SET status='accepted',
         response='accepted',
         responded_at=NOW(),
         updated_at=NOW()
   WHERE tenant_id=p_tenant_id AND id=v_next_offer_id
     AND status='queued';

  UPDATE ride_offers
     SET responded_at=COALESCE(responded_at,NOW()),
         response=COALESCE(response,'rejected'),
         status=CASE WHEN status='offered' THEN 'rejected' ELSE status END,
         updated_at=NOW()
   WHERE tenant_id=p_tenant_id AND ride_id=v_next_ride_id
     AND id <> v_next_offer_id;

  UPDATE drivers
     SET status='on_ride', updated_at=NOW()
   WHERE tenant_id=p_tenant_id AND id=v_driver_id;

  COMMIT;

  SELECT 'promoted' AS mode, v_next_ride_id AS next_ride_id, v_next_offer_id AS next_offer_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_complete_ride_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_distance_m` INT, IN `p_duration_s` INT)   BEGIN
  DECLARE v_prev_status VARCHAR(20);
  DECLARE v_economico VARCHAR(64); DECLARE v_plate VARCHAR(64);

  SELECT status INTO v_prev_status
  FROM rides
  WHERE id=p_ride_id AND tenant_id=p_tenant_id AND driver_id IS NOT NULL AND status='accepted'
  LIMIT 1;
  IF v_prev_status IS NULL THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT='Ride no finalizable (tenant/driver/status)'; END IF;

  IF p_distance_m IS NOT NULL THEN
    UPDATE rides SET distance_m=p_distance_m WHERE id=p_ride_id AND tenant_id=p_tenant_id;
  END IF;
  IF p_duration_s IS NOT NULL THEN
    UPDATE rides SET duration_s=p_duration_s WHERE id=p_ride_id AND tenant_id=p_tenant_id;
  END IF;

  SELECT v.economico, v.plate INTO v_economico, v_plate
  FROM vehicles v JOIN rides r ON r.vehicle_id=v.id
  WHERE r.id=p_ride_id AND r.tenant_id=p_tenant_id LIMIT 1;

  UPDATE rides SET status='finished', finished_at=NOW()
   WHERE id=p_ride_id AND tenant_id=p_tenant_id;

  VALUES (p_tenant_id, p_ride_id, v_prev_status, 'finished',
          JSON_OBJECT('distance_m', p_distance_m, 'duration_s', p_duration_s,
                      'economico', v_economico, 'plate', v_plate),
          NOW());
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_create_offer_v2` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED, IN `p_expires_sec` INT)   proc: BEGIN
  DECLARE v_origin_lat DOUBLE;
  DECLARE v_origin_lng DOUBLE;
  DECLARE v_ride_status VARCHAR(20);

  DECLARE v_vehicle_id BIGINT UNSIGNED;
  DECLARE v_driver_status VARCHAR(10);

  DECLARE v_driver_lat DOUBLE;
  DECLARE v_driver_lng DOUBLE;

  DECLARE v_distance_m INT;
  DECLARE v_eta_seconds INT;

  DECLARE v_round_no INT;
  DECLARE v_existing BIGINT UNSIGNED;

  DECLARE v_now DATETIME;
  DECLARE v_offer_id BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_dedupe_key VARCHAR(190);

  /* dispatch track context */
  DECLARE v_track_id BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_phase VARCHAR(10) DEFAULT NULL;     /* 'stand'|'street' */
  DECLARE v_kind  VARCHAR(10) DEFAULT NULL;     /* 'base'|'street' */
  DECLARE v_stand_id BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_attempt_no SMALLINT UNSIGNED DEFAULT NULL;

  /* 1) ride ofertable + origen (ENDURECIDO: driver_id debe ser NULL) */
  SELECT r.origin_lat, r.origin_lng, r.status
    INTO v_origin_lat, v_origin_lng, v_ride_status
  FROM rides r
  WHERE r.id = p_ride_id
    AND r.tenant_id = p_tenant_id
    AND r.driver_id IS NULL
    AND r.status IN ('requested','offered','searching','scheduled')
  LIMIT 1;

  IF v_ride_status IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no ofertable (tenant/status/driver_id)';
  END IF;
  IF v_origin_lat IS NULL OR v_origin_lng IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no ofertable: origen NULL';
  END IF;

  /* 2) status driver (ENDURECIDO: SOLO idle) */
  SELECT d.status
    INTO v_driver_status
  FROM drivers d
  WHERE d.id = p_driver_id
    AND d.tenant_id = p_tenant_id
  LIMIT 1;

  IF v_driver_status IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver inexistente';
  END IF;
  IF v_driver_status <> 'idle' THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver no válido (solo idle)';
  END IF;

  /* 3) coords driver (driver_locations) */
  SELECT dl.lat, dl.lng
    INTO v_driver_lat, v_driver_lng
  FROM driver_locations dl
  WHERE dl.tenant_id = p_tenant_id
    AND dl.driver_id = p_driver_id
  ORDER BY dl.id DESC
  LIMIT 1;

  IF v_driver_lat IS NULL OR v_driver_lng IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver sin coords (driver_locations vacío)';
  END IF;

  /* 4) shift -> vehicle */
  SELECT s.vehicle_id
    INTO v_vehicle_id
  FROM driver_shifts s
  WHERE s.tenant_id = p_tenant_id
    AND s.driver_id = p_driver_id
    AND s.status = 'abierto'
    AND s.vehicle_id IS NOT NULL
  ORDER BY s.id DESC
  LIMIT 1;

  IF v_vehicle_id IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Driver sin shift abierto/vehículo';
  END IF;

  /* 5) track actual (si existe) */
  SELECT t.id, t.stand_id,
         CASE WHEN t.state='stand_active' THEN 'stand' ELSE 'street' END,
         t.stand_attempt_no
    INTO v_track_id, v_stand_id, v_phase, v_attempt_no
  FROM ride_dispatch_tracks t
  WHERE t.tenant_id = p_tenant_id
    AND t.ride_id   = p_ride_id
  LIMIT 1;

  IF v_phase = 'stand' THEN
    SET v_kind = 'base';
  ELSE
    SET v_kind = 'street';
  END IF;

  /* 6) distancia/eta */
  SET v_distance_m = ROUND(haversine_km(v_origin_lat, v_origin_lng, v_driver_lat, v_driver_lng) * 1000);
  SET v_eta_seconds = CASE
    WHEN v_distance_m IS NULL THEN NULL
    ELSE ROUND(v_distance_m / 6.94)
  END;

  /* 7) round_no */
  SELECT COALESCE(MAX(ro.round_no),0) + 1
    INTO v_round_no
  FROM ride_offers ro
  WHERE ro.ride_id = p_ride_id;

  /* 8) reuse offered viva (ENDURECIDO: offered/pending_passenger) */
  SELECT ro.id
    INTO v_existing
  FROM ride_offers ro
  WHERE ro.tenant_id = p_tenant_id
    AND ro.ride_id   = p_ride_id
    AND ro.driver_id = p_driver_id
    AND ro.status IN ('offered','pending_passenger')
  ORDER BY ro.id DESC
  LIMIT 1;

  SET v_now = NOW();

  IF v_existing IS NOT NULL THEN
    UPDATE ride_offers
       SET sent_at    = v_now,
           expires_at = DATE_ADD(v_now, INTERVAL p_expires_sec SECOND),
           vehicle_id = v_vehicle_id,
           eta_seconds= v_eta_seconds,
           distance_m = v_distance_m,

           kind = v_kind,
           stand_id = v_stand_id,
           dispatch_track_id = v_track_id,
           dispatch_phase = v_phase,
           dispatch_attempt_no = v_attempt_no,

           updated_at = v_now
     WHERE id = v_existing;

    IF v_phase='stand' AND v_track_id IS NOT NULL THEN
      UPDATE ride_dispatch_tracks
         SET stand_current_driver_id = p_driver_id,
             stand_current_offer_id  = v_existing,
             updated_at = v_now
       WHERE id = v_track_id;
    END IF;

    /* OUTBOX (reuse) */
    SET v_offer_id = v_existing;
    SET v_dedupe_key = CONCAT('offer.new:', v_offer_id, ':', DATE_FORMAT(v_now, '%Y%m%d%H%i%s'));
    CALL sp_outbox_put_v1(p_tenant_id, p_ride_id, v_offer_id, p_driver_id, 'offer.new', v_dedupe_key);

  ELSE
      tenant_id, ride_id, driver_id, vehicle_id,
      sent_at, responded_at, status, response,
      eta_seconds, expires_at, distance_m, round_no,
      kind, stand_id, dispatch_track_id, dispatch_phase, dispatch_attempt_no,
      is_direct,
      created_at, updated_at
    )
    VALUES(
      p_tenant_id, p_ride_id, p_driver_id, v_vehicle_id,
      v_now, NULL, 'offered', NULL,
      v_eta_seconds, DATE_ADD(v_now, INTERVAL p_expires_sec SECOND),
      v_distance_m, v_round_no,
      v_kind, v_stand_id, v_track_id, v_phase, v_attempt_no,
      0,
      v_now, v_now
    );

    SET v_offer_id = LAST_INSERT_ID();

    IF v_phase='stand' AND v_track_id IS NOT NULL THEN
      UPDATE ride_dispatch_tracks
         SET stand_current_driver_id = p_driver_id,
             stand_current_offer_id  = v_offer_id,
             updated_at = v_now
       WHERE id = v_track_id;
    END IF;

    /* OUTBOX (new) */
    SET v_dedupe_key = CONCAT('offer.new:', v_offer_id, ':', DATE_FORMAT(v_now, '%Y%m%d%H%i%s'));
    CALL sp_outbox_put_v1(p_tenant_id, p_ride_id, v_offer_id, p_driver_id, 'offer.new', v_dedupe_key);
  END IF;

  /* 9) ride requested -> offered */
  IF v_ride_status = 'requested' THEN
    UPDATE rides
       SET status='offered', updated_at=v_now
     WHERE tenant_id=p_tenant_id
       AND id=p_ride_id
       AND status='requested'
       AND driver_id IS NULL;
  END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_dispatch_track_tick_v1` (IN `p_tenant_id` BIGINT UNSIGNED)   tick_flow: BEGIN
  DECLARE v_now DATETIME DEFAULT NOW();

  DECLARE v_track_id BIGINT UNSIGNED;
  DECLARE v_ride_id  BIGINT UNSIGNED;
  DECLARE v_state    VARCHAR(20);
  DECLARE v_stand_id BIGINT UNSIGNED;

  DECLARE v_stand_step_sec INT DEFAULT 30;
  DECLARE v_street_expires_sec INT DEFAULT 180;
  DECLARE v_wave_n INT DEFAULT 8;
  DECLARE v_radius_km DOUBLE DEFAULT 5.0;

  DECLARE v_ride_status VARCHAR(32);

  DECLARE v_offer_id BIGINT UNSIGNED;
  DECLARE v_offer_driver_id BIGINT UNSIGNED;
  DECLARE v_offer_expires DATETIME;
  DECLARE v_offer_status VARCHAR(32);

  DECLARE v_next_driver_id BIGINT UNSIGNED;
  DECLARE v_next_qid BIGINT UNSIGNED;
  DECLARE v_cur_qid  BIGINT UNSIGNED;

  DECLARE v_max_pos INT;

  DECLARE v_street_expires_at DATETIME;
  DECLARE v_remaining_sec INT;

  /* outbox helpers */
  DECLARE v_rows INT DEFAULT 0;
  DECLARE v_dedupe_key VARCHAR(255);

  DECLARE v_new_offer_id BIGINT UNSIGNED DEFAULT NULL;

  DECLARE done INT DEFAULT 0;

  /* error handling per-track */
  DECLARE v_call_failed TINYINT DEFAULT 0;

  DECLARE cur CURSOR FOR
    SELECT id, ride_id, state, stand_id
    FROM ride_dispatch_tracks
    WHERE tenant_id = p_tenant_id
      AND state IN ('stand_active','street_active')
      AND (locked_at IS NULL OR locked_at < DATE_SUB(v_now, INTERVAL 5 SECOND))
    ORDER BY id ASC;

  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

  /* settings */
  SELECT
    COALESCE(ds.auto_dispatch_radius_km, 5.00),
    COALESCE(ds.offer_expires_sec, 180),
    COALESCE(ds.wave_size_n, 8)
  INTO v_radius_km, v_street_expires_sec, v_wave_n
  FROM dispatch_settings ds
  WHERE ds.tenant_id = p_tenant_id
  LIMIT 1;

  IF v_wave_n IS NULL OR v_wave_n < 1 THEN SET v_wave_n = 1; END IF;
  IF v_wave_n > 50 THEN SET v_wave_n = 50; END IF;
  IF v_street_expires_sec < 30 THEN SET v_street_expires_sec = 180; END IF;
  IF v_stand_step_sec < 10 THEN SET v_stand_step_sec = 30; END IF;

  OPEN cur;

  tracks_loop: LOOP
    FETCH cur INTO v_track_id, v_ride_id, v_state, v_stand_id;
    IF done = 1 THEN LEAVE tracks_loop; END IF;

    /* lock */
    UPDATE ride_dispatch_tracks
       SET locked_by='tick', locked_at=v_now, updated_at=v_now
     WHERE id=v_track_id AND tenant_id=p_tenant_id
       AND (locked_at IS NULL OR locked_at < DATE_SUB(v_now, INTERVAL 5 SECOND));

    IF (SELECT locked_by FROM ride_dispatch_tracks WHERE id=v_track_id LIMIT 1) <> 'tick' THEN
      ITERATE tracks_loop;
    END IF;

    /* ride ofertable */
    SELECT r.status
      INTO v_ride_status
    FROM rides r
    WHERE r.tenant_id=p_tenant_id
      AND r.id=v_ride_id
      AND r.driver_id IS NULL
      AND r.origin_lat IS NOT NULL
      AND r.origin_lng IS NOT NULL
      AND r.status IN ('requested','offered','searching','bidding','scheduled')
    LIMIT 1;

    IF v_ride_status IS NULL THEN
      UPDATE ride_dispatch_tracks
         SET state='completed', locked_by=NULL, locked_at=NULL, updated_at=v_now
       WHERE id=v_track_id AND tenant_id=p_tenant_id;
      ITERATE tracks_loop;
    END IF;

    /* ============================================================
       STAND ACTIVE
       ============================================================ */
    IF v_state='stand_active' THEN

      UPDATE ride_dispatch_tracks
         SET stand_next_action_at = COALESCE(stand_next_action_at, v_now),
             stand_step_sec = COALESCE(stand_step_sec, v_stand_step_sec)
       WHERE id=v_track_id AND tenant_id=p_tenant_id;

      IF (SELECT stand_next_action_at FROM ride_dispatch_tracks WHERE id=v_track_id AND tenant_id=p_tenant_id LIMIT 1) > v_now THEN
        UPDATE ride_dispatch_tracks
           SET locked_by=NULL, locked_at=NULL, updated_at=v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
        ITERATE tracks_loop;
      END IF;

      /* offer canónica del track */
      SET v_offer_id=NULL; SET v_offer_driver_id=NULL; SET v_offer_expires=NULL; SET v_offer_status=NULL;

      /* 1) la que el track tiene como actual */
      SELECT stand_current_offer_id, stand_current_driver_id
        INTO v_offer_id, v_offer_driver_id
      FROM ride_dispatch_tracks
      WHERE id=v_track_id AND tenant_id=p_tenant_id
      LIMIT 1;

      /* si hay offer_id, leerla */
      IF v_offer_id IS NOT NULL THEN
        SELECT ro.expires_at, ro.status
          INTO v_offer_expires, v_offer_status
        FROM ride_offers ro
        WHERE ro.tenant_id=p_tenant_id AND ro.id=v_offer_id
        LIMIT 1;
      END IF;

      /* 2) fallback: si track no tiene offer_id, buscar la última stand del track */
      IF v_offer_id IS NULL THEN
        SELECT ro.id, ro.driver_id, ro.expires_at, ro.status
          INTO v_offer_id, v_offer_driver_id, v_offer_expires, v_offer_status
        FROM ride_offers ro
        WHERE ro.tenant_id=p_tenant_id
          AND ro.ride_id=v_ride_id
          AND ro.dispatch_track_id=v_track_id
          AND ro.dispatch_phase='stand'
        ORDER BY ro.id DESC
        LIMIT 1;
      END IF;

      /* si sigue viva -> reprograma */
      IF v_offer_id IS NOT NULL
         AND v_offer_status IN ('offered','pending_passenger')
         AND v_offer_expires > v_now THEN

        UPDATE ride_dispatch_tracks
           SET stand_current_driver_id=v_offer_driver_id,
               stand_current_offer_id=v_offer_id,
               stand_next_action_at=v_offer_expires,
               locked_by=NULL, locked_at=NULL, updated_at=v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;

        ITERATE tracks_loop;
      END IF;

      /* timeout: released + responded_at + outbox update */
      IF v_offer_id IS NOT NULL THEN
        UPDATE ride_offers
           SET status='released',
               response='timeout_stand',
               responded_at = COALESCE(responded_at, v_now),
               updated_at=v_now
         WHERE id=v_offer_id AND tenant_id=p_tenant_id
           AND status IN ('offered','pending_passenger');

        SET v_rows = ROW_COUNT();
        IF v_rows > 0 THEN
          SET v_dedupe_key = CONCAT('offer.update:', v_offer_id, ':released');
          CALL sp_outbox_put_v1(p_tenant_id, v_ride_id, v_offer_id, v_offer_driver_id, 'offer.update', v_dedupe_key);
        END IF;
      END IF;

      /* mover SOLO la fila del driver actual a saltado (si existe) */
      IF v_offer_driver_id IS NOT NULL THEN

        SELECT COALESCE(MAX(position),0) INTO v_max_pos
        FROM taxi_stand_queue
        WHERE tenant_id=p_tenant_id AND stand_id=v_stand_id
          AND status IN ('en_cola','saltado','asignado');

        /* fila activa real (active_key=1) */
        SET v_cur_qid = NULL;
        SELECT q.id INTO v_cur_qid
        FROM taxi_stand_queue q
        WHERE q.tenant_id=p_tenant_id
          AND q.stand_id=v_stand_id
          AND q.driver_id=v_offer_driver_id
          AND q.active_key=1
        ORDER BY q.id DESC
        LIMIT 1;

        /* fallback raro: status='asignado' */
        IF v_cur_qid IS NULL THEN
          SELECT q.id INTO v_cur_qid
          FROM taxi_stand_queue q
          WHERE q.tenant_id=p_tenant_id
            AND q.stand_id=v_stand_id
            AND q.driver_id=v_offer_driver_id
            AND q.status='asignado'
          ORDER BY q.id DESC
          LIMIT 1;
        END IF;

        IF v_cur_qid IS NOT NULL THEN
          UPDATE taxi_stand_queue
             SET status='saltado',
                 active_key=0,
                 position=v_max_pos+1
           WHERE id=v_cur_qid;
        END IF;

        /* guardrail mínimo: si por bug hay otro active_key, apagarlo SIN tocar status */
        UPDATE taxi_stand_queue
           SET active_key=0
         WHERE tenant_id=p_tenant_id
           AND stand_id=v_stand_id
           AND active_key=1;

      END IF;

      /* elegir siguiente SOLO en_cola */
      SET v_next_driver_id=NULL; SET v_next_qid=NULL;

      SELECT q.driver_id, q.id
        INTO v_next_driver_id, v_next_qid
      FROM taxi_stand_queue q
      JOIN drivers d
        ON d.id=q.driver_id AND d.tenant_id=p_tenant_id AND d.status='idle'
      JOIN driver_shifts s
        ON s.driver_id=d.id AND s.tenant_id=p_tenant_id AND s.status='abierto' AND s.vehicle_id IS NOT NULL
      WHERE q.tenant_id=p_tenant_id
        AND q.stand_id=v_stand_id
        AND q.status='en_cola'
        AND NOT EXISTS (
          SELECT 1 FROM ride_offers ro_any
          WHERE ro_any.tenant_id=p_tenant_id
            AND ro_any.ride_id=v_ride_id
            AND ro_any.driver_id=q.driver_id
        )
      ORDER BY q.position ASC, q.id ASC
      LIMIT 1;

      IF v_next_driver_id IS NOT NULL THEN

        /* marcar SOLO a este como asignado (nadie más cambia) */
        UPDATE taxi_stand_queue
           SET status='asignado',
               active_key=1
         WHERE id=v_next_qid
           AND status='en_cola';

        /* crear oferta BASE con 30s (stand_step_sec) */
        SET v_call_failed = 0;
        BEGIN
          DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET v_call_failed = 1;
          CALL sp_create_offer_v2(p_tenant_id, v_ride_id, v_next_driver_id, v_stand_step_sec);
        END;

        IF v_call_failed = 1 THEN
          UPDATE ride_dispatch_tracks
             SET state='completed', locked_by=NULL, locked_at=NULL, updated_at=v_now
           WHERE id=v_track_id AND tenant_id=p_tenant_id;
          ITERATE tracks_loop;
        END IF;

        /* leer la offer creada/reusada (stand) */
        SET v_new_offer_id = NULL;
        SELECT ro2.id
          INTO v_new_offer_id
        FROM ride_offers ro2
        WHERE ro2.tenant_id=p_tenant_id
          AND ro2.ride_id=v_ride_id
          AND ro2.driver_id=v_next_driver_id
          AND ro2.dispatch_track_id=v_track_id
          AND ro2.dispatch_phase='stand'
          AND ro2.status IN ('offered','pending_passenger')
        ORDER BY ro2.id DESC
        LIMIT 1;

        UPDATE ride_dispatch_tracks
           SET stand_attempt_no = stand_attempt_no + 1,
               stand_current_driver_id=v_next_driver_id,
               stand_current_offer_id=v_new_offer_id,
               stand_next_action_at=DATE_ADD(v_now, INTERVAL v_stand_step_sec SECOND),
               locked_by=NULL, locked_at=NULL, updated_at=v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;

        ITERATE tracks_loop;
      END IF;

      /* base agotada => street_active */
      SELECT street_expires_at INTO v_street_expires_at
      FROM ride_dispatch_tracks WHERE id=v_track_id AND tenant_id=p_tenant_id;

      IF v_street_expires_at IS NULL THEN
        SET v_street_expires_at = DATE_ADD(v_now, INTERVAL v_street_expires_sec SECOND);
      END IF;

      UPDATE ride_dispatch_tracks
         SET state='street_active',
             street_radius_km=COALESCE(street_radius_km, v_radius_km),
             street_target_n=COALESCE(street_target_n, v_wave_n),
             street_expires_at=v_street_expires_at,
             street_last_fill_at=NULL,
             stand_current_driver_id=NULL,
             stand_current_offer_id=NULL,
             stand_next_action_at=NULL,
             locked_by=NULL, locked_at=NULL, updated_at=v_now
       WHERE id=v_track_id AND tenant_id=p_tenant_id;

      SET v_remaining_sec = GREATEST(1, TIMESTAMPDIFF(SECOND, v_now, v_street_expires_at));

      /* wave inicial calle */
      SET v_call_failed = 0;
      BEGIN
        DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET v_call_failed = 1;
        CALL sp_offer_wave_prio_v3(p_tenant_id, v_ride_id, v_radius_km, v_wave_n, v_remaining_sec);
      END;

      IF v_call_failed = 1 THEN
        UPDATE ride_dispatch_tracks
           SET state='completed', locked_by=NULL, locked_at=NULL, updated_at=v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
        ITERATE tracks_loop;
      END IF;

      UPDATE ride_dispatch_tracks
         SET street_sent_n = (
             SELECT COUNT(DISTINCT ro.driver_id)
             FROM ride_offers ro
             WHERE ro.tenant_id=p_tenant_id AND ro.ride_id=v_ride_id
           ),
           street_last_fill_at=v_now,
           locked_by=NULL, locked_at=NULL, updated_at=v_now
       WHERE id=v_track_id AND tenant_id=p_tenant_id;

      ITERATE tracks_loop;
    END IF;

    /* ============================================================
       STREET ACTIVE (fill calle)
       ============================================================ */
    IF v_state='street_active' THEN

      SELECT street_expires_at INTO v_street_expires_at
      FROM ride_dispatch_tracks WHERE id=v_track_id AND tenant_id=p_tenant_id;

      IF v_street_expires_at IS NULL THEN
        SET v_street_expires_at = DATE_ADD(v_now, INTERVAL v_street_expires_sec SECOND);
        UPDATE ride_dispatch_tracks SET street_expires_at=v_street_expires_at
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
      END IF;

      IF v_street_expires_at <= v_now THEN
        UPDATE ride_dispatch_tracks
           SET state='completed', locked_by=NULL, locked_at=NULL, updated_at=v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
        ITERATE tracks_loop;
      END IF;

      SET v_remaining_sec = GREATEST(1, TIMESTAMPDIFF(SECOND, v_now, v_street_expires_at));

      /* wave fill */
      SET v_call_failed = 0;
      BEGIN
        DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET v_call_failed = 1;
        CALL sp_offer_wave_prio_v3(
          p_tenant_id,
          v_ride_id,
          COALESCE((SELECT street_radius_km FROM ride_dispatch_tracks WHERE id=v_track_id AND tenant_id=p_tenant_id LIMIT 1), v_radius_km),
          COALESCE((SELECT street_target_n  FROM ride_dispatch_tracks WHERE id=v_track_id AND tenant_id=p_tenant_id LIMIT 1), v_wave_n),
          v_remaining_sec
        );
      END;

      IF v_call_failed = 1 THEN
        UPDATE ride_dispatch_tracks
           SET state='completed', locked_by=NULL, locked_at=NULL, updated_at=v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
        ITERATE tracks_loop;
      END IF;

      UPDATE ride_dispatch_tracks
         SET street_sent_n = (
             SELECT COUNT(DISTINCT ro.driver_id)
             FROM ride_offers ro
             WHERE ro.tenant_id=p_tenant_id AND ro.ride_id=v_ride_id
           ),
           street_last_fill_at=v_now,
           locked_by=NULL, locked_at=NULL, updated_at=v_now
       WHERE id=v_track_id AND tenant_id=p_tenant_id;

      ITERATE tracks_loop;
    END IF;

    UPDATE ride_dispatch_tracks
       SET locked_by=NULL, locked_at=NULL, updated_at=v_now
     WHERE id=v_track_id AND tenant_id=p_tenant_id;

  END LOOP;

  CLOSE cur;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_expire_offers_v2` (IN `p_tenant_id` BIGINT UNSIGNED)   BEGIN
  DECLARE v_now DATETIME DEFAULT NOW();

  UPDATE ride_offers
     SET status = CASE
                    WHEN (dispatch_phase='stand' OR kind='base' OR stand_id IS NOT NULL) THEN 'released'
                    ELSE 'expired'
                  END,
         response = COALESCE(
           response,
           CASE
             WHEN (dispatch_phase='stand' OR kind='base' OR stand_id IS NOT NULL) THEN 'timeout_stand'
             ELSE 'expired'
           END
         ),
         responded_at = COALESCE(responded_at, v_now),
         updated_at = v_now
   WHERE tenant_id = p_tenant_id
     AND status IN ('offered','pending_passenger')
     AND expires_at IS NOT NULL
     AND expires_at <= v_now;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_nearby_drivers` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_origin_lat` DOUBLE, IN `p_origin_lng` DOUBLE, IN `p_radius_km` DOUBLE)   BEGIN
  DECLARE v_fresh_sec INT DEFAULT 30;

  
  DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;
  CREATE TEMPORARY TABLE tmp_driver_lastloc (
    driver_id        BIGINT UNSIGNED PRIMARY KEY,
    last_reported_at DATETIME NOT NULL,
    lat              DOUBLE NOT NULL,
    lng              DOUBLE NOT NULL
  ) ENGINE=MEMORY;

  SELECT dl.driver_id, dl.reported_at, dl.lat, dl.lng
  FROM driver_locations dl
  JOIN (
    SELECT driver_id, MAX(id) AS last_id
    FROM driver_locations
    WHERE tenant_id = p_tenant_id
    GROUP BY driver_id
  ) x
    ON x.driver_id = dl.driver_id AND x.last_id = dl.id
  WHERE dl.tenant_id = p_tenant_id;

  SELECT
    d.id         AS driver_id,
    s.vehicle_id AS vehicle_id,
    d.status,
    ll.lat       AS last_lat,
    ll.lng       AS last_lng,
    ROUND(haversine_km(p_origin_lat, p_origin_lng, ll.lat, ll.lng), 3) AS distance_km
  FROM drivers d
  INNER JOIN tmp_driver_lastloc ll
    ON ll.driver_id = d.id
   AND ll.last_reported_at >= DATE_SUB(NOW(), INTERVAL v_fresh_sec SECOND)
  INNER JOIN driver_shifts s
    ON s.driver_id = d.id
   AND s.tenant_id = p_tenant_id
   AND s.status = 'abierto'
   AND s.vehicle_id IS NOT NULL
  WHERE d.tenant_id = p_tenant_id
    AND d.status = 'idle'
    AND haversine_km(p_origin_lat, p_origin_lng, ll.lat, ll.lng) <= p_radius_km
  ORDER BY distance_km ASC
  LIMIT 100;

  DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_offer_wave_prio_v3` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_radius_km` DOUBLE, IN `p_limit_n` INT, IN `p_expires_sec` INT)   wave_flow: BEGIN
  DECLARE v_now DATETIME DEFAULT NOW();

  DECLARE v_lat DOUBLE;
  DECLARE v_lng DOUBLE;
  DECLARE v_ride_status VARCHAR(32);

  DECLARE v_limit_n INT DEFAULT 8;
  DECLARE v_radius_km DOUBLE DEFAULT 5.00;
  DECLARE v_stand_radius_km DOUBLE DEFAULT 3.00;

  DECLARE v_fresh_sec INT DEFAULT 240;
  DECLARE v_max_inbox INT DEFAULT 10;

  DECLARE v_base_step_sec INT DEFAULT 30;
  DECLARE v_street_expires_sec INT DEFAULT 180;

  DECLARE v_stand_id BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_top_driver_id BIGINT UNSIGNED DEFAULT NULL;

  /* track */
  DECLARE v_track_id BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_track_state VARCHAR(20) DEFAULT NULL;
  DECLARE v_track_stand_id BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_track_street_expires_at DATETIME DEFAULT NULL;
  DECLARE v_track_target_n INT DEFAULT NULL;
  DECLARE v_track_radius DOUBLE DEFAULT NULL;
  DECLARE v_sent_n INT DEFAULT 0;
  DECLARE v_missing INT DEFAULT 0;
  DECLARE v_remaining_sec INT DEFAULT NULL;

  /* cursor calle */
  DECLARE v_driver_id BIGINT UNSIGNED;
  DECLARE done INT DEFAULT 0;

  DECLARE cur CURSOR FOR
    SELECT driver_id
    FROM tmp_wave_candidates
    ORDER BY last_sent_at ASC, distance_km ASC;

  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

  /* settings */
  SELECT
    COALESCE(ds.stand_radius_km, 3.00),
    COALESCE(p_radius_km, ds.auto_dispatch_radius_km, 5.00),
    COALESCE(ds.offer_expires_sec, 180),
    COALESCE(p_limit_n, ds.wave_size_n, 8)
  INTO v_stand_radius_km, v_radius_km, v_street_expires_sec, v_limit_n
  FROM (SELECT 1) x
  LEFT JOIN dispatch_settings ds ON ds.tenant_id = p_tenant_id
  LIMIT 1;

  IF v_limit_n < 1 THEN SET v_limit_n = 1; END IF;
  IF v_limit_n > 50 THEN SET v_limit_n = 50; END IF;
  IF v_radius_km IS NULL OR v_radius_km <= 0 THEN SET v_radius_km = 5.00; END IF;

  /* ride ofertable */
  SELECT r.origin_lat, r.origin_lng, r.status
    INTO v_lat, v_lng, v_ride_status
  FROM rides r
  WHERE r.id = p_ride_id
    AND r.tenant_id = p_tenant_id
    AND r.driver_id IS NULL
    AND r.status IN ('requested','offered','searching','bidding','scheduled')
  LIMIT 1;

  IF v_lat IS NULL OR v_lng IS NULL OR v_ride_status IS NULL THEN
    SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'Ride no ofertable (tenant/status/driver_id/origen)';
  END IF;

  /* cargar track si existe */
  SELECT t.id, t.state, t.stand_id, t.street_expires_at, t.street_target_n, t.street_radius_km
    INTO v_track_id, v_track_state, v_track_stand_id, v_track_street_expires_at, v_track_target_n, v_track_radius
  FROM ride_dispatch_tracks t
  WHERE t.tenant_id=p_tenant_id AND t.ride_id=p_ride_id
  LIMIT 1;

  /* ============================================================
     Si hay track:
       - stand_active: NO HACER NADA (tick manda)
       - street_active: SOLO FILL CALLE
     ============================================================ */

  IF v_track_id IS NOT NULL THEN

    IF v_track_state = 'stand_active' THEN
      /* base la mueve el tick, aquí no hacemos one-by-one */
      LEAVE wave_flow;
    END IF;

    IF v_track_state = 'street_active' THEN

      /* ventana fija: remaining_sec contra street_expires_at */
      IF v_track_street_expires_at IS NULL THEN
        /* si por inconsistencia no está, fija una vez */
        SET v_track_street_expires_at = DATE_ADD(v_now, INTERVAL v_street_expires_sec SECOND);
        UPDATE ride_dispatch_tracks
           SET street_expires_at = v_track_street_expires_at
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
      END IF;

      SET v_remaining_sec = GREATEST(1, TIMESTAMPDIFF(SECOND, v_now, v_track_street_expires_at));

      /* si ya venció ventana, no crear nada */
      IF v_remaining_sec <= 0 THEN
        LEAVE wave_flow;
      END IF;

      /* target/radius desde track, fallback a settings */
      SET v_track_target_n = COALESCE(v_track_target_n, v_limit_n);
      SET v_track_radius   = COALESCE(v_track_radius, v_radius_km);

      /* sent_n real (estable) */
      SELECT COUNT(DISTINCT ro.driver_id)
        INTO v_sent_n
      FROM ride_offers ro
      WHERE ro.tenant_id=p_tenant_id
        AND ro.ride_id=p_ride_id;

      SET v_missing = GREATEST(0, v_track_target_n - v_sent_n);

      IF v_missing = 0 THEN
        /* ya está completo */
        UPDATE ride_dispatch_tracks
           SET street_sent_n = v_sent_n,
               street_last_fill_at = v_now,
               updated_at = v_now
         WHERE id=v_track_id AND tenant_id=p_tenant_id;
        LEAVE wave_flow;
      END IF;

      /* lastloc */
      DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;
      CREATE TEMPORARY TABLE tmp_driver_lastloc (
        driver_id        BIGINT UNSIGNED PRIMARY KEY,
        last_reported_at DATETIME NOT NULL,
        lat              DOUBLE NOT NULL,
        lng              DOUBLE NOT NULL
      ) ENGINE=MEMORY;

      SELECT dl.driver_id, dl.reported_at, dl.lat, dl.lng
      FROM driver_locations dl
      JOIN (
        SELECT driver_id, MAX(id) AS last_id
        FROM driver_locations
        WHERE tenant_id = p_tenant_id
        GROUP BY driver_id
      ) x ON x.driver_id = dl.driver_id AND x.last_id = dl.id
      WHERE dl.tenant_id = p_tenant_id;

      /* candidatos calle (EXCLUYE cualquiera que ya tenga offer de este ride, sin importar status) */
      DROP TEMPORARY TABLE IF EXISTS tmp_wave_candidates;
      CREATE TEMPORARY TABLE tmp_wave_candidates (
        driver_id    BIGINT UNSIGNED PRIMARY KEY,
        last_sent_at DATETIME NULL,
        distance_km  DOUBLE NOT NULL
      ) ENGINE=MEMORY;

      SELECT
        d.id,
        (SELECT MAX(ro0.sent_at) FROM ride_offers ro0 WHERE ro0.tenant_id=p_tenant_id AND ro0.driver_id=d.id),
        haversine_km(ll.lat, ll.lng, v_lat, v_lng)
      FROM drivers d
      JOIN tmp_driver_lastloc ll
        ON ll.driver_id=d.id
       AND ll.last_reported_at >= DATE_SUB(v_now, INTERVAL v_fresh_sec SECOND)
      JOIN driver_shifts s
        ON s.driver_id=d.id
       AND s.tenant_id=p_tenant_id
       AND s.status='abierto'
       AND s.vehicle_id IS NOT NULL
      WHERE d.tenant_id=p_tenant_id
        AND d.status IN ('idle','on_ride')
        AND haversine_km(ll.lat, ll.lng, v_lat, v_lng) <= v_track_radius
        AND NOT EXISTS (
          SELECT 1
          FROM ride_offers ro
          WHERE ro.tenant_id=p_tenant_id
            AND ro.ride_id=p_ride_id
            AND ro.driver_id=d.id
        )
        AND (
          SELECT COUNT(*)
          FROM ride_offers rox
          WHERE rox.tenant_id=p_tenant_id
            AND rox.driver_id=d.id
            AND rox.status IN ('offered','pending_passenger','queued')
            AND rox.expires_at > v_now
        ) < v_max_inbox;

      SET done = 0;
      OPEN cur;

      read_loop: LOOP
        FETCH cur INTO v_driver_id;
        IF done=1 THEN LEAVE read_loop; END IF;

        /* crear offer con remaining_sec real; sp_create_offer_v2 tomará phase=street por track.state */
        CALL sp_create_offer_v2(p_tenant_id, p_ride_id, v_driver_id, v_remaining_sec);

        SET v_missing = v_missing - 1;
        IF v_missing <= 0 THEN LEAVE read_loop; END IF;
      END LOOP;

      CLOSE cur;

      /* recalcular sent_n real */
      SELECT COUNT(DISTINCT ro.driver_id)
        INTO v_sent_n
      FROM ride_offers ro
      WHERE ro.tenant_id=p_tenant_id
        AND ro.ride_id=p_ride_id;

      UPDATE ride_dispatch_tracks
         SET street_sent_n = v_sent_n,
             street_last_fill_at = v_now,
             updated_at = v_now
       WHERE id=v_track_id AND tenant_id=p_tenant_id;

      DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;
      DROP TEMPORARY TABLE IF EXISTS tmp_wave_candidates;

      LEAVE wave_flow;
    END IF;

    /* cualquier otro estado: no hacemos nada */
    LEAVE wave_flow;
  END IF;

  /* ============================================================
     No hay track: decidir INIT (base si hay EN_COLA, si no calle)
     ============================================================ */

  /* lastloc para evaluar base/calle */
  DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;
  CREATE TEMPORARY TABLE tmp_driver_lastloc (
    driver_id        BIGINT UNSIGNED PRIMARY KEY,
    last_reported_at DATETIME NOT NULL,
    lat              DOUBLE NOT NULL,
    lng              DOUBLE NOT NULL
  ) ENGINE=MEMORY;

  SELECT dl.driver_id, dl.reported_at, dl.lat, dl.lng
  FROM driver_locations dl
  JOIN (
    SELECT driver_id, MAX(id) AS last_id
    FROM driver_locations
    WHERE tenant_id = p_tenant_id
    GROUP BY driver_id
  ) x ON x.driver_id = dl.driver_id AND x.last_id = dl.id
  WHERE dl.tenant_id = p_tenant_id;

  /* stand más cercano (solo referencia) */
  SELECT ts.id
    INTO v_stand_id
  FROM taxi_stands ts
  WHERE ts.tenant_id = p_tenant_id
    AND ts.activo = 1
    AND haversine_km(ts.latitud, ts.longitud, v_lat, v_lng) <= v_stand_radius_km
  ORDER BY haversine_km(ts.latitud, ts.longitud, v_lat, v_lng) ASC, ts.id ASC
  LIMIT 1;

  /* ===== BASE: SOLO si hay EN_COLA elegible (NO saltado) ===== */
  IF v_stand_id IS NOT NULL THEN

    SELECT q.driver_id
      INTO v_top_driver_id
    FROM taxi_stand_queue q
    JOIN drivers d
      ON d.id=q.driver_id
     AND d.tenant_id=p_tenant_id
     AND d.status='idle'
    JOIN tmp_driver_lastloc ll
      ON ll.driver_id=d.id
     AND ll.last_reported_at >= DATE_SUB(v_now, INTERVAL v_fresh_sec SECOND)
    JOIN driver_shifts s
      ON s.driver_id=q.driver_id
     AND s.tenant_id=p_tenant_id
     AND s.status='abierto'
     AND s.vehicle_id IS NOT NULL
    WHERE q.tenant_id=p_tenant_id
      AND q.stand_id=v_stand_id
      AND q.status='en_cola'              /* ✅ SOLO en_cola */
      AND NOT EXISTS (
        SELECT 1
        FROM ride_offers ro_any
        WHERE ro_any.tenant_id=p_tenant_id
          AND ro_any.ride_id=p_ride_id
          AND ro_any.driver_id=q.driver_id
      )
      AND (
        SELECT COUNT(*)
        FROM ride_offers rox
        WHERE rox.tenant_id=p_tenant_id
          AND rox.driver_id=q.driver_id
          AND rox.status IN ('offered','pending_passenger','queued')
          AND rox.expires_at > v_now
      ) < v_max_inbox
    ORDER BY q.position ASC, q.id ASC
    LIMIT 1;

    IF v_top_driver_id IS NOT NULL THEN

      /* crear track stand_active (tick lo mueve) */
        tenant_id, ride_id, stand_id, state,
        stand_step_sec, stand_attempt_no,
        street_radius_km, street_target_n, street_sent_n,
        created_at, updated_at
      )
      VALUES(
        p_tenant_id, p_ride_id, v_stand_id, 'stand_active',
        v_base_step_sec, 0,
        v_radius_km, v_limit_n, 0,
        v_now, v_now
      );

      SELECT id INTO v_track_id
      FROM ride_dispatch_tracks
      WHERE tenant_id=p_tenant_id AND ride_id=p_ride_id
      LIMIT 1;

      /* programar primera acción inmediata (tick respetará next_action) */
      UPDATE ride_dispatch_tracks
         SET stand_next_action_at = v_now,
             updated_at = v_now
       WHERE id=v_track_id;

      /* marcar fila como asignado (solo para reflejo visual/operativo) */
      UPDATE taxi_stand_queue
         SET active_key = 0,
             status = CASE WHEN status='asignado' THEN 'en_cola' ELSE status END
       WHERE tenant_id=p_tenant_id
         AND driver_id=v_top_driver_id
         AND active_key=1;

     

      /* crear SOLO la primera offer de base (30s). El tick se encarga del resto */
      CALL sp_create_offer_v2(p_tenant_id, p_ride_id, v_top_driver_id, v_base_step_sec);

      /* actualizar contador en track */
      UPDATE ride_dispatch_tracks
         SET stand_attempt_no = stand_attempt_no + 1,
             stand_next_action_at = DATE_ADD(v_now, INTERVAL v_base_step_sec SECOND),
             updated_at=v_now
       WHERE id=v_track_id;

      /* requested -> offered */
      IF v_ride_status='requested' THEN
        UPDATE rides
           SET status='offered', updated_at=v_now
         WHERE tenant_id=p_tenant_id AND id=p_ride_id AND status='requested' AND driver_id IS NULL;
      END IF;

      DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;
      LEAVE wave_flow;
    END IF;
  END IF;

  /* ===== no base elegible => INIT street_active + fill (misma lógica fill usando track) ===== */
    tenant_id, ride_id, stand_id, state,
    stand_step_sec, stand_attempt_no,
    street_radius_km, street_target_n, street_sent_n,
    street_expires_at, street_last_fill_at,
    created_at, updated_at
  )
  VALUES(
    p_tenant_id, p_ride_id, NULL, 'street_active',
    v_base_step_sec, 0,
    v_radius_km, v_limit_n, 0,
    DATE_ADD(v_now, INTERVAL v_street_expires_sec SECOND), v_now,
    v_now, v_now
  );

  /* re-entrar a fill street llamando a nosotros mismos sería feo, así que copiamos fill mínimo */
  SELECT id, street_expires_at INTO v_track_id, v_track_street_expires_at
  FROM ride_dispatch_tracks
  WHERE tenant_id=p_tenant_id AND ride_id=p_ride_id
  LIMIT 1;

  SET v_remaining_sec = GREATEST(1, TIMESTAMPDIFF(SECOND, v_now, v_track_street_expires_at));

  /* sent/target/missing */
  SELECT COUNT(DISTINCT ro.driver_id) INTO v_sent_n
  FROM ride_offers ro
  WHERE ro.tenant_id=p_tenant_id AND ro.ride_id=p_ride_id;

  SET v_missing = GREATEST(0, v_limit_n - v_sent_n);

  IF v_missing > 0 THEN

    DROP TEMPORARY TABLE IF EXISTS tmp_wave_candidates;
    CREATE TEMPORARY TABLE tmp_wave_candidates (
      driver_id    BIGINT UNSIGNED PRIMARY KEY,
      last_sent_at DATETIME NULL,
      distance_km  DOUBLE NOT NULL
    ) ENGINE=MEMORY;

    SELECT
      d.id,
      (SELECT MAX(ro0.sent_at) FROM ride_offers ro0 WHERE ro0.tenant_id=p_tenant_id AND ro0.driver_id=d.id),
      haversine_km(ll.lat, ll.lng, v_lat, v_lng)
    FROM drivers d
    JOIN tmp_driver_lastloc ll
      ON ll.driver_id=d.id
     AND ll.last_reported_at >= DATE_SUB(v_now, INTERVAL v_fresh_sec SECOND)
    JOIN driver_shifts s
      ON s.driver_id=d.id AND s.tenant_id=p_tenant_id AND s.status='abierto' AND s.vehicle_id IS NOT NULL
    WHERE d.tenant_id=p_tenant_id
      AND d.status IN ('idle','on_ride')
      AND haversine_km(ll.lat, ll.lng, v_lat, v_lng) <= v_radius_km
      AND NOT EXISTS (
        SELECT 1 FROM ride_offers ro
        WHERE ro.tenant_id=p_tenant_id AND ro.ride_id=p_ride_id AND ro.driver_id=d.id
      )
      AND (
        SELECT COUNT(*)
        FROM ride_offers rox
        WHERE rox.tenant_id=p_tenant_id
          AND rox.driver_id=d.id
          AND rox.status IN ('offered','pending_passenger','queued')
          AND rox.expires_at > v_now
      ) < v_max_inbox;

    SET done=0;
    OPEN cur;
    read2: LOOP
      FETCH cur INTO v_driver_id;
      IF done=1 THEN LEAVE read2; END IF;

      CALL sp_create_offer_v2(p_tenant_id, p_ride_id, v_driver_id, v_remaining_sec);

      SET v_missing = v_missing - 1;
      IF v_missing <= 0 THEN LEAVE read2; END IF;
    END LOOP;
    CLOSE cur;

    DROP TEMPORARY TABLE IF EXISTS tmp_wave_candidates;
  END IF;

  SELECT COUNT(DISTINCT ro.driver_id) INTO v_sent_n
  FROM ride_offers ro
  WHERE ro.tenant_id=p_tenant_id AND ro.ride_id=p_ride_id;

  UPDATE ride_dispatch_tracks
     SET street_sent_n = v_sent_n,
         street_last_fill_at = v_now,
         updated_at=v_now
   WHERE id=v_track_id AND tenant_id=p_tenant_id;

  IF v_ride_status='requested' THEN
    UPDATE rides
       SET status='offered', updated_at=v_now
     WHERE tenant_id=p_tenant_id AND id=p_ride_id AND status='requested' AND driver_id IS NULL;
  END IF;

  DROP TEMPORARY TABLE IF EXISTS tmp_driver_lastloc;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_offer_wave_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_radius_km` DOUBLE, IN `p_limit_n` INT, IN `p_expires_sec` INT)   BEGIN
  DECLARE v_origin_lat DOUBLE;
  DECLARE v_origin_lng DOUBLE;
  DECLARE v_driver_id  BIGINT UNSIGNED;
  DECLARE done INT DEFAULT 0;

  DECLARE cur_drivers CURSOR FOR
    SELECT d.id
    FROM drivers d
    JOIN driver_shifts s
      ON s.driver_id = d.id
     AND s.tenant_id = p_tenant_id
     AND s.status = 'abierto'
    WHERE d.tenant_id = p_tenant_id
      AND d.status = 'idle'
      AND d.last_lat IS NOT NULL
      AND d.last_lng IS NOT NULL
      AND haversine_km(v_origin_lat, v_origin_lng, d.last_lat, d.last_lng) <= p_radius_km
    ORDER BY haversine_km(v_origin_lat, v_origin_lng, d.last_lat, d.last_lng) ASC
    LIMIT p_limit_n;

  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

  
  SELECT r.origin_lat, r.origin_lng
    INTO v_origin_lat, v_origin_lng
  FROM rides r
  WHERE r.id = p_ride_id
    AND r.tenant_id = p_tenant_id
    AND r.driver_id IS NULL
    AND r.status IN ('requested','offered','queued')   
  LIMIT 1;

  IF v_origin_lat IS NULL OR v_origin_lng IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no ofertable (tenant/estado/driver_id/origen)';
  END IF;

  OPEN cur_drivers;
  read_loop: LOOP
    FETCH cur_drivers INTO v_driver_id;
    IF done = 1 THEN LEAVE read_loop; END IF;

    IF NOT EXISTS (
      SELECT 1
      FROM ride_offers ro
      WHERE ro.tenant_id = p_tenant_id
        AND ro.ride_id   = p_ride_id
        AND ro.driver_id = v_driver_id
        AND ro.status IN ('offered','accepted')
      LIMIT 1
    ) THEN
      CALL sp_create_offer_v2(p_tenant_id, p_ride_id, v_driver_id, p_expires_sec);
    END IF;
  END LOOP;
  CLOSE cur_drivers;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_offer_wave_v2` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_driver_ids_csv` TEXT, IN `p_expires_sec` INT)   BEGIN
  DECLARE v_origin_lat DOUBLE;
  DECLARE v_origin_lng DOUBLE;
  DECLARE v_token      VARCHAR(50);
  DECLARE v_csv        TEXT;
  DECLARE v_pos        INT;
  DECLARE v_driver_id  BIGINT UNSIGNED;

  
  SELECT r.origin_lat, r.origin_lng
    INTO v_origin_lat, v_origin_lng
  FROM rides r
  WHERE r.id = p_ride_id
    AND r.tenant_id = p_tenant_id
    AND r.driver_id IS NULL
    AND r.status IN ('requested','offered','queued')   
  LIMIT 1;

  IF v_origin_lat IS NULL OR v_origin_lng IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no ofertable (tenant/estado/driver_id/origen)';
  END IF;

  SET v_csv = TRIM(p_driver_ids_csv);

  WHILE v_csv IS NOT NULL AND v_csv <> '' DO
    SET v_pos = INSTR(v_csv, ',');
    IF v_pos = 0 THEN
      SET v_token = TRIM(v_csv);
      SET v_csv   = '';
    ELSE
      SET v_token = TRIM(SUBSTRING(v_csv, 1, v_pos - 1));
      SET v_csv   = TRIM(SUBSTRING(v_csv, v_pos + 1));
    END IF;

    IF v_token <> '' THEN
      SET v_driver_id = CAST(v_token AS UNSIGNED);

      IF NOT EXISTS (
        SELECT 1 FROM ride_offers ro
        WHERE ro.tenant_id = p_tenant_id
          AND ro.ride_id   = p_ride_id
          AND ro.driver_id = v_driver_id
          AND ro.status IN ('offered','accepted')
        LIMIT 1
      ) THEN
        IF EXISTS (
          SELECT 1
          FROM drivers d
          JOIN driver_shifts s
            ON s.driver_id = d.id
           AND s.tenant_id = p_tenant_id
           AND s.status = 'abierto'
          WHERE d.id = v_driver_id
            AND d.tenant_id = p_tenant_id
            AND d.status = 'idle'
            AND d.last_lat IS NOT NULL
            AND d.last_lng IS NOT NULL
          LIMIT 1
        ) THEN
          CALL sp_create_offer_v2(p_tenant_id, p_ride_id, v_driver_id, p_expires_sec);
        END IF;
      END IF;
    END IF;
  END WHILE;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_outbox_put_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_offer_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED, IN `p_topic` VARCHAR(64), IN `p_dedupe_key` VARCHAR(190))   BEGIN
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_queue_join_stand_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_stand_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED)   BEGIN
  DECLARE v_dest_ok BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_maxpos INT DEFAULT 0;

  DECLARE v_sid BIGINT UNSIGNED;
  DECLARE done INT DEFAULT 0;

  /* cursor para reindexar stands “ensuciados” */
  DECLARE cur CURSOR FOR
    SELECT stand_id FROM tmp_dirty_stands;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

  START TRANSACTION;

  /* 1) Validar/lock stand destino */
  SELECT id
    INTO v_dest_ok
  FROM taxi_stands
  WHERE id = p_stand_id
    AND tenant_id = p_tenant_id
    AND activo = 1
  FOR UPDATE;

  IF v_dest_ok IS NULL THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Stand inválido/inactivo';
  END IF;

  /* 2) LIMPIEZA DURA del driver en TODO el tenant:
        cualquier activo -> salio (libera uq_driver_one_active sí o sí) */
  DROP TEMPORARY TABLE IF EXISTS tmp_dirty_stands;
  CREATE TEMPORARY TABLE tmp_dirty_stands (
    stand_id BIGINT UNSIGNED NOT NULL PRIMARY KEY
  ) ENGINE=MEMORY;

  SELECT DISTINCT stand_id
  FROM taxi_stand_queue
  WHERE tenant_id = p_tenant_id
    AND driver_id = p_driver_id
    AND status IN ('en_cola','saltado','asignado')
  FOR UPDATE;

  UPDATE taxi_stand_queue
     SET status = 'salio'
   WHERE tenant_id = p_tenant_id
     AND driver_id = p_driver_id
     AND status IN ('en_cola','saltado','asignado');

  /* 3) Reindexar cada stand afectado (por la limpieza) */
  OPEN cur;
  read_loop: LOOP
    FETCH cur INTO v_sid;
    IF done = 1 THEN
      LEAVE read_loop;
    END IF;

    UPDATE taxi_stand_queue q
    JOIN (
      SELECT id,
             ROW_NUMBER() OVER (
               ORDER BY
                 CASE WHEN status='en_cola' THEN 0 ELSE 1 END,
                 position ASC,
                 id ASC
             ) rn
      FROM taxi_stand_queue
      WHERE tenant_id = p_tenant_id
        AND stand_id  = v_sid
        AND status IN ('en_cola','saltado','asignado')
    ) x ON x.id = q.id
    SET q.position = x.rn
    WHERE q.tenant_id = p_tenant_id
      AND q.stand_id  = v_sid
      AND q.status IN ('en_cola','saltado','asignado');

  END LOOP;
  CLOSE cur;

  /* 4) Calcular última posición SOLO del bloque en_cola en destino */
  SELECT COALESCE(MAX(position),0)
    INTO v_maxpos
  FROM taxi_stand_queue
  WHERE tenant_id = p_tenant_id
    AND stand_id  = p_stand_id
    AND status = 'en_cola'
  FOR UPDATE;

  /* 5) Insertar al final del bloque en_cola */

  /* 6) Reindex final del stand destino */
  UPDATE taxi_stand_queue q
  JOIN (
    SELECT id,
           ROW_NUMBER() OVER (
             ORDER BY
               CASE WHEN status='en_cola' THEN 0 ELSE 1 END,
               position ASC,
               id ASC
           ) rn
    FROM taxi_stand_queue
    WHERE tenant_id = p_tenant_id
      AND stand_id  = p_stand_id
      AND status IN ('en_cola','saltado','asignado')
  ) x ON x.id = q.id
  SET q.position = x.rn
  WHERE q.tenant_id = p_tenant_id
    AND q.stand_id  = p_stand_id
    AND q.status IN ('en_cola','saltado','asignado');

  COMMIT;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_queue_leave_stand_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_stand_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED, IN `p_status_to` VARCHAR(32))   BEGIN
  DECLARE v_pos INT DEFAULT NULL;
  DECLARE v_to  VARCHAR(32);

  SET v_to = CASE
    WHEN p_status_to IN ('salio','asignado') THEN p_status_to
    ELSE 'salio'
  END;

  START TRANSACTION;

  SELECT position
    INTO v_pos
  FROM taxi_stand_queue
  WHERE tenant_id = p_tenant_id
    AND stand_id  = p_stand_id
    AND driver_id = p_driver_id
    AND status IN ('en_cola','saltado')
  ORDER BY id DESC
  LIMIT 1
  FOR UPDATE;

  IF v_pos IS NULL THEN
    COMMIT;
  ELSE

    UPDATE taxi_stand_queue
       SET status = v_to
     WHERE tenant_id = p_tenant_id
       AND stand_id  = p_stand_id
       AND driver_id = p_driver_id
       AND status IN ('en_cola','saltado');

    UPDATE taxi_stand_queue
       SET position = position - 1
     WHERE tenant_id = p_tenant_id
       AND stand_id  = p_stand_id
       AND status IN ('en_cola','saltado')
       AND position > v_pos;

    COMMIT;
  END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_queue_on_accept_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED)   BEGIN
  DECLARE v_stand_id BIGINT UNSIGNED DEFAULT NULL;

  START TRANSACTION;

  SELECT stand_id
    INTO v_stand_id
  FROM taxi_stand_queue
  WHERE tenant_id = p_tenant_id
    AND driver_id = p_driver_id
    AND status IN ('en_cola','saltado')
  ORDER BY id DESC
  LIMIT 1
  FOR UPDATE;

  IF v_stand_id IS NOT NULL THEN
    CALL sp_queue_leave_stand_v1(p_tenant_id, v_stand_id, p_driver_id, 'asignado');
  END IF;

  COMMIT;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_queue_rebalance_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_stand_id` BIGINT UNSIGNED)   BEGIN
  DROP TEMPORARY TABLE IF EXISTS tmp_reb;
  CREATE TEMPORARY TABLE tmp_reb (driver_id BIGINT UNSIGNED PRIMARY KEY, new_pos INT) ENGINE=MEMORY;

  SELECT driver_id, ROW_NUMBER() OVER (ORDER BY joined_at ASC)
  FROM taxi_stand_queue
  WHERE tenant_id=p_tenant_id AND stand_id=p_stand_id AND status='en_cola';

  UPDATE taxi_stand_queue q
  JOIN tmp_reb r ON r.driver_id=q.driver_id
  SET q.position=r.new_pos
  WHERE q.tenant_id=p_tenant_id AND q.stand_id=p_stand_id AND q.status='en_cola';
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_quote_ride_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_when_ts` DATETIME)   BEGIN
  DECLARE v_dist_m INT;
  DECLARE v_dur_s  INT;
  DECLARE v_km     DOUBLE;
  DECLARE v_min    DOUBLE;

  DECLARE v_base DECIMAL(10,2);
  DECLARE v_per_km DECIMAL(10,4);
  DECLARE v_per_min DECIMAL(10,4);
  DECLARE v_night_multiplier DECIMAL(8,4);
  DECLARE v_round_to INT;
  DECLARE v_min_total DECIMAL(10,2);

  DECLARE v_subtotal DECIMAL(12,4);
  DECLARE v_mult DECIMAL(8,4);
  DECLARE v_quoted DECIMAL(10,2);
  DECLARE v_when DATETIME;

  
  SET v_when = COALESCE(p_when_ts, NOW());

  
  SELECT r.distance_m, r.duration_s
    INTO v_dist_m, v_dur_s
  FROM rides r
  WHERE r.id = p_ride_id
    AND r.tenant_id = p_tenant_id
  LIMIT 1;

  IF v_dist_m IS NULL OR v_dur_s IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride sin distancia/tiempo: fija ruta antes de cotizar';
  END IF;

  
  SELECT base_fee, per_km, per_min, night_multiplier, round_to, min_total
    INTO v_base, v_per_km, v_per_min, v_night_multiplier, v_round_to, v_min_total
  FROM tenant_fare_policies
  WHERE tenant_id = p_tenant_id
  ORDER BY id DESC
  LIMIT 1;

  IF v_base IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No hay política de tarifa activa para el tenant';
  END IF;

  
  SET v_km  = v_dist_m / 1000.0;
  SET v_min = v_dur_s / 60.0;

  SET v_subtotal = v_base + (v_km * v_per_km) + (v_min * v_per_min);
  SET v_subtotal = GREATEST(v_subtotal, v_min_total);

  
  SET v_mult = CASE WHEN (HOUR(v_when) >= 22 OR HOUR(v_when) < 6) THEN COALESCE(v_night_multiplier, 1.0) ELSE 1.0 END;

  
  SET v_quoted = ROUND(v_subtotal * v_mult, COALESCE(v_round_to, 2));

  
  UPDATE rides
     SET quoted_amount = v_quoted,
         fare_snapshot = JSON_OBJECT(
           'calc_at',        DATE_FORMAT(NOW(), '%Y-%m-%d %H:%i:%s'),
           'policy',         JSON_OBJECT(
                               'base_fee', v_base,
                               'per_km', v_per_km,
                               'per_min', v_per_min,
                               'night_multiplier', v_night_multiplier,
                               'round_to', v_round_to,
                               'min_total', v_min_total
                             ),
           'input',          JSON_OBJECT(
                               'distance_m', v_dist_m,
                               'duration_s', v_dur_s,
                               'when', DATE_FORMAT(v_when, '%Y-%m-%d %H:%i:%s')
                             ),
           'calc',           JSON_OBJECT(
                               'km', v_km,
                               'min', v_min,
                               'subtotal', v_subtotal,
                               'multiplier', v_mult
                             ),
           'quoted_amount',  v_quoted
         )
   WHERE id = p_ride_id
     AND tenant_id = p_tenant_id;

  
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_quote_ride_v2` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_when_ts` DATETIME)   BEGIN
  DECLARE v_dist_m INT; DECLARE v_dur_s INT;
  DECLARE v_km DOUBLE; DECLARE v_min DOUBLE;
  DECLARE v_base DECIMAL(10,2);
  DECLARE v_per_km DECIMAL(10,4); DECLARE v_per_min DECIMAL(10,4);
  DECLARE v_night_mult DECIMAL(8,4);
  DECLARE v_round_mode ENUM('decimals','step');
  DECLARE v_round_decimals TINYINT; DECLARE v_round_step DECIMAL(10,2);
  DECLARE v_min_total DECIMAL(10,2);
  DECLARE v_subtotal DECIMAL(12,4); DECLARE v_mult DECIMAL(8,4);
  DECLARE v_quoted DECIMAL(12,2);
  DECLARE v_when DATETIME;
  DECLARE v_nstart TINYINT; DECLARE v_nend TINYINT;
  DECLARE v_partial BOOL DEFAULT FALSE;

  SET v_when = COALESCE(p_when_ts, NOW());

  
  SELECT distance_m, duration_s INTO v_dist_m, v_dur_s
  FROM rides WHERE id=p_ride_id AND tenant_id=p_tenant_id LIMIT 1;
  IF v_dist_m IS NULL AND v_dur_s IS NULL THEN
    SET v_partial = TRUE; 
  END IF;

  
  SELECT base_fee, per_km, per_min, night_multiplier,
         COALESCE(night_start_hour,22), COALESCE(night_end_hour,6),
         COALESCE(round_mode,'step'), COALESCE(round_decimals,0), COALESCE(round_step,1.00),
         min_total
    INTO v_base, v_per_km, v_per_min, v_night_mult,
         v_nstart, v_nend,
         v_round_mode, v_round_decimals, v_round_step,
         v_min_total
  FROM tenant_fare_policies
  WHERE tenant_id = p_tenant_id
  ORDER BY id DESC LIMIT 1;

  IF v_base IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No hay política de tarifa activa para el tenant';
  END IF;

  
  IF v_partial = FALSE THEN
    SET v_km  = v_dist_m / 1000.0;
    SET v_min = v_dur_s / 60.0;
    SET v_subtotal = v_base + (v_km * v_per_km) + (v_min * v_per_min);
  ELSE
    SET v_km  = NULL; SET v_min = NULL;
    SET v_subtotal = v_base;  
  END IF;

  SET v_subtotal = GREATEST(v_subtotal, v_min_total);

  
  SET v_mult =
    CASE
      WHEN (v_nstart IS NOT NULL AND v_nend IS NOT NULL) AND
           (HOUR(v_when) >= v_nstart OR HOUR(v_when) < v_nend)
      THEN COALESCE(v_night_mult,1.0)
      ELSE 1.0
    END;

  
  IF v_round_mode = 'decimals' THEN
    SET v_quoted = ROUND(v_subtotal * v_mult, COALESCE(v_round_decimals,0));
  ELSE
    SET v_quoted = round_to_step(v_subtotal * v_mult, COALESCE(v_round_step,1.00));
  END IF;

  
  UPDATE rides
     SET quoted_amount = v_quoted,
         fare_snapshot = JSON_OBJECT(
           'calc_at', DATE_FORMAT(NOW(), '%Y-%m-%d %H:%i:%s'),
           'policy', JSON_OBJECT(
             'base_fee', v_base, 'per_km', v_per_km, 'per_min', v_per_min,
             'night_multiplier', v_night_mult,
             'night_start_hour', v_nstart, 'night_end_hour', v_nend,
             'round_mode', v_round_mode, 'round_decimals', v_round_decimals, 'round_step', v_round_step,
             'min_total', v_min_total
           ),
           'input', JSON_OBJECT(
             'distance_m', v_dist_m, 'duration_s', v_dur_s,
             'when', DATE_FORMAT(v_when, '%Y-%m-%d %H:%i:%s')
           ),
           'calc', JSON_OBJECT(
             'km', v_km, 'min', v_min,
             'subtotal', v_subtotal, 'multiplier', v_mult,
             'partial', v_partial
           ),
           'quoted_amount', v_quoted
         )
   WHERE id=p_ride_id AND tenant_id=p_tenant_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reject_offer_v2` (IN `p_offer_id` BIGINT UNSIGNED)   BEGIN
  DECLARE v_ride_id BIGINT UNSIGNED;
  DECLARE v_tenant_id BIGINT UNSIGNED;
  DECLARE v_status VARCHAR(20);
  DECLARE v_expires DATETIME;

  
  SELECT ro.ride_id, ro.tenant_id, ro.status, ro.expires_at
    INTO v_ride_id, v_tenant_id, v_status, v_expires
  FROM ride_offers ro
  WHERE ro.id = p_offer_id
  LIMIT 1;

  IF v_ride_id IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Oferta inexistente';
  END IF;

  IF v_status <> 'offered' THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Solo ofertas en estado offered pueden rechazarse';
  END IF;

  IF v_expires IS NOT NULL AND v_expires < NOW() THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'La oferta ya está expirada';
  END IF;

  
  UPDATE ride_offers
     SET responded_at = NOW(),
         response    = 'rejected',
         status      = 'rejected'
   WHERE id = p_offer_id;

  
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_release_ride_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED)   BEGIN
  CALL sp_release_ride_v2(p_tenant_id, p_ride_id, 'dispatch', NULL);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_release_ride_v2` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_released_by` VARCHAR(32), IN `p_reason` TEXT)   rel_flow: BEGIN
  DECLARE v_prev_status VARCHAR(32);
  DECLARE v_driver_id BIGINT UNSIGNED;
  DECLARE v_vehicle_id BIGINT UNSIGNED;

  DECLARE v_offer_id BIGINT UNSIGNED;

  DECLARE v_economico VARCHAR(64);
  DECLARE v_plate VARCHAR(64);

  DECLARE v_has_active INT DEFAULT 0;

  DECLARE _nf INT DEFAULT 0;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET _nf = 1;

  START TRANSACTION;

  
  SET _nf = 0;
  SELECT r.status, r.driver_id, r.vehicle_id
    INTO v_prev_status, v_driver_id, v_vehicle_id
  FROM rides r
  WHERE r.tenant_id = p_tenant_id AND r.id = p_ride_id
  FOR UPDATE;

  IF _nf = 1 THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT='Ride inexistente o de otro tenant';
  END IF;

  IF v_prev_status NOT IN ('accepted','queued') THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT='Ride no liberable en su estado actual';
  END IF;

  
  SET _nf = 0;
  SELECT ro.id
    INTO v_offer_id
  FROM ride_offers ro
  WHERE ro.tenant_id=p_tenant_id AND ro.ride_id=p_ride_id
    AND ro.status IN ('accepted','queued')
  ORDER BY ro.id DESC
  LIMIT 1
  FOR UPDATE;

  
  IF v_offer_id IS NOT NULL THEN
    UPDATE ride_offers
       SET responded_at = NOW(),
           response     = 'released',
           status       = 'released',
           updated_at   = NOW()
     WHERE id = v_offer_id AND tenant_id = p_tenant_id;
  END IF;

  
  UPDATE ride_offers
     SET responded_at = COALESCE(responded_at, NOW()),
         response     = COALESCE(response, 'expired'),
         status       = CASE
                          WHEN status='offered' THEN 'expired'
                          WHEN status='queued'  THEN 'released'
                          ELSE status
                        END,
         updated_at   = NOW()
   WHERE tenant_id=p_tenant_id AND ride_id=p_ride_id
     AND status IN ('offered','queued');

  
  SELECT v.economico, v.plate
    INTO v_economico, v_plate
  FROM vehicles v
  WHERE v.id = v_vehicle_id
  LIMIT 1;

  
  UPDATE rides
     SET driver_id   = NULL,
         vehicle_id  = NULL,
         status      = 'requested',
         accepted_at = NULL,
         updated_at  = NOW()
   WHERE tenant_id=p_tenant_id AND id=p_ride_id;

  IF ROW_COUNT() = 0 THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT='No se pudo liberar (race/estado)';
  END IF;

  
  IF v_driver_id IS NOT NULL THEN
    SELECT EXISTS(
      SELECT 1 FROM rides r
      WHERE r.tenant_id=p_tenant_id
        AND r.driver_id=v_driver_id
        AND r.status IN ('accepted','en_route','arrived','on_board')
      LIMIT 1
    ) INTO v_has_active;

    IF v_has_active = 0 THEN
      UPDATE drivers
         SET status='idle', updated_at=NOW()
       WHERE tenant_id=p_tenant_id AND id=v_driver_id;
    END IF;
  END IF;

  VALUES (
    p_tenant_id, p_ride_id, v_prev_status, 'requested',
    JSON_OBJECT(
      'released_offer_id', v_offer_id,
      'prev_driver_id', v_driver_id,
      'prev_vehicle_id', v_vehicle_id,
      'economico', v_economico,
      'plate', v_plate,
      'released_by', NULLIF(TRIM(COALESCE(p_released_by,'')),''),
      'reason', NULLIF(TRIM(COALESCE(p_reason,'')),'')
    ),
    NOW()
  );

  COMMIT;

  SELECT 'released' AS mode, v_driver_id AS prev_driver_id, v_offer_id AS released_offer_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ride_finish_v2` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED)   BEGIN
  finish_flow: BEGIN
    DECLARE v_driver_id BIGINT UNSIGNED;
    DECLARE v_prev_status VARCHAR(32);

    DECLARE v_next_offer_id BIGINT UNSIGNED;
    DECLARE v_next_ride_id  BIGINT UNSIGNED;
    DECLARE v_next_vehicle_id BIGINT UNSIGNED;

    DECLARE _nf INT DEFAULT 0;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET _nf = 1;

    START TRANSACTION;

    
    SET _nf = 0;
    SELECT driver_id, status
      INTO v_driver_id, v_prev_status
    FROM rides
    WHERE id = p_ride_id AND tenant_id = p_tenant_id
    FOR UPDATE;

    IF _nf = 1 THEN
      ROLLBACK;
      SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride no existe';
    END IF;

    
    UPDATE rides
       SET status      = 'finished',
           finished_at = COALESCE(finished_at, NOW()),
           updated_at  = NOW()
     WHERE id = p_ride_id AND tenant_id = p_tenant_id;

    
    IF v_driver_id IS NULL THEN
      COMMIT;
      SELECT 'finished' AS mode, NULL AS next_ride_id, NULL AS next_offer_id;
      LEAVE finish_flow;
    END IF;

    
    SET _nf = 0;
    SET v_next_offer_id = NULL;
    SET v_next_ride_id  = NULL;
    SET v_next_vehicle_id = NULL;

    SELECT o.id, o.ride_id, o.vehicle_id
      INTO v_next_offer_id, v_next_ride_id, v_next_vehicle_id
    FROM ride_offers o
    JOIN rides r
      ON r.id = o.ride_id
     AND r.tenant_id = o.tenant_id
    WHERE o.tenant_id = p_tenant_id
      AND o.driver_id = v_driver_id
      AND o.status    = 'queued'
      AND r.status    = 'queued'
      AND (r.driver_id IS NULL OR r.driver_id = v_driver_id)
    ORDER BY COALESCE(o.queued_position, 999999) ASC,
             COALESCE(o.queued_at, o.created_at) ASC,
             o.id ASC
    LIMIT 1
    FOR UPDATE;

    
    IF _nf = 1 OR v_next_offer_id IS NULL OR v_next_ride_id IS NULL THEN
      UPDATE drivers
         SET status     = 'idle',
             updated_at = NOW()
       WHERE id = v_driver_id
         AND tenant_id = p_tenant_id;

      COMMIT;
      SELECT 'finished' AS mode, NULL AS next_ride_id, NULL AS next_offer_id;
      LEAVE finish_flow;
    END IF;

    
    UPDATE rides
       SET driver_id   = COALESCE(driver_id, v_driver_id),
           vehicle_id  = COALESCE(vehicle_id, v_next_vehicle_id),
           status      = 'accepted',
           accepted_at = COALESCE(accepted_at, NOW()),
           updated_at  = NOW()
     WHERE id = v_next_ride_id
       AND tenant_id = p_tenant_id
       AND status IN ('requested','offered','scheduled','queued')
       AND (driver_id IS NULL OR driver_id = v_driver_id);

    IF ROW_COUNT() = 0 THEN
      
      UPDATE drivers
         SET status     = 'idle',
             updated_at = NOW()
       WHERE id = v_driver_id
         AND tenant_id = p_tenant_id;

      COMMIT;
      SELECT 'finished' AS mode, NULL AS next_ride_id, NULL AS next_offer_id;
      LEAVE finish_flow;
    END IF;

    
    UPDATE ride_offers
       SET status       = 'accepted',
           response     = 'accepted',
           responded_at = NOW(),
           updated_at   = NOW()
     WHERE id = v_next_offer_id
       AND status = 'queued';

    
    UPDATE ride_offers
       SET responded_at = COALESCE(responded_at, NOW()),
           response     = COALESCE(response, 'rejected'),
           status       = CASE WHEN status='offered' THEN 'rejected' ELSE status END,
           updated_at   = NOW()
     WHERE tenant_id = p_tenant_id
       AND ride_id   = v_next_ride_id
       AND id       <> v_next_offer_id;

    
    UPDATE drivers
       SET status     = 'on_ride',
           updated_at = NOW()
     WHERE id = v_driver_id
       AND tenant_id = p_tenant_id;

    COMMIT;

    SELECT 'promoted' AS mode, v_next_ride_id AS next_ride_id, v_next_offer_id AS next_offer_id;

  END finish_flow;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_set_route_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_ride_id` BIGINT UNSIGNED, IN `p_distance_m` INT, IN `p_duration_s` INT, IN `p_polyline` TEXT)   BEGIN
  IF NOT EXISTS (SELECT 1 FROM rides WHERE id=p_ride_id AND tenant_id=p_tenant_id LIMIT 1) THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ride inexistente o de otro tenant';
  END IF;

  UPDATE rides
     SET distance_m = p_distance_m,
         duration_s = p_duration_s,
         route_polyline = p_polyline
   WHERE id = p_ride_id AND tenant_id = p_tenant_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_taxi_stand_join_v1` (IN `p_tenant_id` BIGINT UNSIGNED, IN `p_stand_id` BIGINT UNSIGNED, IN `p_driver_id` BIGINT UNSIGNED)   proc: BEGIN
  DECLARE v_dest_ok BIGINT UNSIGNED DEFAULT NULL;

  DECLARE v_prev_stand BIGINT UNSIGNED DEFAULT NULL;
  DECLARE v_prev_pos   INT DEFAULT NULL;
  DECLARE v_prev_status VARCHAR(16) DEFAULT NULL;

  DECLARE v_maxpos INT DEFAULT 0;

  START TRANSACTION;

  /* 1) Validar/lock stand destino */
  SELECT id
    INTO v_dest_ok
  FROM taxi_stands
  WHERE id = p_stand_id
    AND tenant_id = p_tenant_id
    AND activo = 1
  FOR UPDATE;

  IF v_dest_ok IS NULL THEN
    ROLLBACK;
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Stand inválido/inactivo';
  END IF;

  /* 2) ¿Driver ya está ACTIVO en algún stand? (incluye asignado) */
  SELECT stand_id, position, status
    INTO v_prev_stand, v_prev_pos, v_prev_status
  FROM taxi_stand_queue
  WHERE tenant_id = p_tenant_id
    AND driver_id = p_driver_id
    AND status IN ('en_cola','saltado','asignado')
  ORDER BY id DESC
  LIMIT 1
  FOR UPDATE;

  /* 2A) Idempotente: ya está en el mismo stand -> NO INSERT, solo normaliza */
  IF v_prev_stand IS NOT NULL AND v_prev_stand = p_stand_id THEN

    /* si estaba asignado, permitir rejoin: bajar a en_cola y apagar active_key */
    UPDATE taxi_stand_queue
       SET active_key = 0,
           status = CASE WHEN status='asignado' THEN 'en_cola' ELSE status END
     WHERE tenant_id = p_tenant_id
       AND stand_id  = p_stand_id
       AND driver_id = p_driver_id
       AND status IN ('en_cola','saltado','asignado');

    /* resecuencia del stand (en_cola antes que saltado; asignado al final) */
    UPDATE taxi_stand_queue q
    JOIN (
      SELECT id,
             ROW_NUMBER() OVER (
               ORDER BY
                 CASE
                   WHEN status='en_cola' THEN 0
                   WHEN status='saltado' THEN 1
                   ELSE 2
                 END ASC,
                 position ASC,
                 id ASC
             ) AS rn
      FROM taxi_stand_queue
      WHERE tenant_id=p_tenant_id
        AND stand_id=p_stand_id
        AND status IN ('en_cola','saltado','asignado')
    ) x ON x.id=q.id
    SET q.position=x.rn
    WHERE q.tenant_id=p_tenant_id
      AND q.stand_id=p_stand_id
      AND q.status IN ('en_cola','saltado','asignado');

    COMMIT;
    LEAVE proc;
  END IF;

  /* 2B) Si estaba activo en otro stand -> salir + limpiar active_key + reindex */
  IF v_prev_stand IS NOT NULL AND v_prev_stand <> p_stand_id THEN

    UPDATE taxi_stand_queue
       SET status='salio',
           active_key=0
     WHERE tenant_id = p_tenant_id
       AND stand_id  = v_prev_stand
       AND driver_id = p_driver_id
       AND status IN ('en_cola','saltado','asignado');

    IF v_prev_pos IS NOT NULL THEN
      UPDATE taxi_stand_queue
         SET position = position - 1
       WHERE tenant_id = p_tenant_id
         AND stand_id  = v_prev_stand
         AND status IN ('en_cola','saltado','asignado')
         AND position > v_prev_pos;
    END IF;

    /* resecuencia del stand anterior */
    UPDATE taxi_stand_queue q
    JOIN (
      SELECT id,
             ROW_NUMBER() OVER (
               ORDER BY
                 CASE
                   WHEN status='en_cola' THEN 0
                   WHEN status='saltado' THEN 1
                   ELSE 2
                 END ASC,
                 position ASC,
                 id ASC
             ) AS rn
      FROM taxi_stand_queue
      WHERE tenant_id=p_tenant_id
        AND stand_id=v_prev_stand
        AND status IN ('en_cola','saltado','asignado')
    ) x ON x.id=q.id
    SET q.position=x.rn
    WHERE q.tenant_id=p_tenant_id
      AND q.stand_id=v_prev_stand
      AND q.status IN ('en_cola','saltado','asignado');

  END IF;

  /* 3) Limpieza defensiva: apagar cualquier active_key del driver (por si quedó basura) */
  UPDATE taxi_stand_queue
     SET active_key = 0
   WHERE tenant_id = p_tenant_id
     AND driver_id = p_driver_id
     AND active_key = 1;

  /* 4) Calcular última posición SOLO en_cola en stand destino */
  SELECT COALESCE(MAX(position),0)
    INTO v_maxpos
  FROM taxi_stand_queue
  WHERE tenant_id = p_tenant_id
    AND stand_id  = p_stand_id
    AND status = 'en_cola'
  FOR UPDATE;

  /* 5) Insertar al final del bloque en_cola */

  /* 6) Resequence del stand destino: en_cola primero, luego saltado, luego asignado */
  UPDATE taxi_stand_queue q
  JOIN (
    SELECT id,
           ROW_NUMBER() OVER (
             ORDER BY
               CASE
                 WHEN status='en_cola' THEN 0
                 WHEN status='saltado' THEN 1
                 ELSE 2
               END ASC,
               position ASC,
               id ASC
           ) AS rn
    FROM taxi_stand_queue
    WHERE tenant_id=p_tenant_id
      AND stand_id=p_stand_id
      AND status IN ('en_cola','saltado','asignado')
  ) x ON x.id=q.id
  SET q.position=x.rn
  WHERE q.tenant_id=p_tenant_id
    AND q.stand_id=p_stand_id
    AND q.status IN ('en_cola','saltado','asignado');

  COMMIT;
END$$

--
-- Funciones
--
CREATE DEFINER=`root`@`localhost` FUNCTION `haversine_km` (`lat1` DOUBLE, `lon1` DOUBLE, `lat2` DOUBLE, `lon2` DOUBLE) RETURNS DOUBLE DETERMINISTIC BEGIN
  DECLARE r_earth_km DOUBLE DEFAULT 6371.0;
  DECLARE dlat DOUBLE; DECLARE dlon DOUBLE;
  DECLARE a DOUBLE; DECLARE c DOUBLE;
  SET dlat = RADIANS(lat2 - lat1);
  SET dlon = RADIANS(lon2 - lon1);
  SET a = SIN(dlat/2)*SIN(dlat/2) +
          COS(RADIANS(lat1))*COS(RADIANS(lat2)) *
          SIN(dlon/2)*SIN(dlon/2);
  SET c = 2 * ATAN2(SQRT(a), SQRT(1-a));
  RETURN r_earth_km * c;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `round_to_step` (`p_amount` DECIMAL(12,4), `p_step` DECIMAL(10,4)) RETURNS DECIMAL(12,2) DETERMINISTIC BEGIN
  DECLARE v_step DECIMAL(10,4);
  SET v_step = CASE WHEN p_step IS NULL OR p_step <= 0 THEN 1.00 ELSE p_step END;
  RETURN ROUND(p_amount / v_step) * v_step;
END$$

