--
-- Disparadores `ride_offers`
--
DELIMITER $$
CREATE TRIGGER `trg_ride_offers_no_double_accept_ins` BEFORE INSERT ON `ride_offers` FOR EACH ROW BEGIN
  IF NEW.status = 'accepted' THEN
    IF EXISTS (
      SELECT 1 FROM ride_offers ro
      WHERE ro.ride_id = NEW.ride_id
        AND ro.status = 'accepted'
      LIMIT 1
    ) THEN
      SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Ya existe una oferta accepted para este ride';
    END IF;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trg_ride_offers_no_double_accept_upd` BEFORE UPDATE ON `ride_offers` FOR EACH ROW BEGIN
  IF NEW.status = 'accepted' AND (OLD.status <> 'accepted') THEN
    IF EXISTS (
      SELECT 1 FROM ride_offers ro
      WHERE ro.ride_id = NEW.ride_id
        AND ro.status = 'accepted'
        AND ro.id <> NEW.id
      LIMIT 1
    ) THEN
      SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Ya existe una oferta accepted para este ride';
    END IF;
  END IF;
END
$$
DELIMITER ;

