--
-- Disparadores `vehicles`
--
DELIMITER $$
CREATE TRIGGER `trg_vehicle_verify_year` BEFORE UPDATE ON `vehicles` FOR EACH ROW BEGIN
  IF NEW.verification_status = 'verified'
     AND NEW.year IS NOT NULL
     AND NEW.year < (YEAR(CURDATE()) - 10) THEN
    SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'No se puede VERIFICAR: vehículo con más de 10 años.';
  END IF;
END
$$
DELIMITER ;

