--
-- Estructura para la vista `driver_ratings_summary`
--
DROP TABLE IF EXISTS `driver_ratings_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `driver_ratings_summary`  AS SELECT `ratings`.`rated_id` AS `driver_id`, `ratings`.`tenant_id` AS `tenant_id`, count(0) AS `total_ratings`, round(avg(`ratings`.`rating`),1) AS `average_rating`, round(avg(`ratings`.`punctuality`),1) AS `avg_punctuality`, round(avg(`ratings`.`courtesy`),1) AS `avg_courtesy`, round(avg(`ratings`.`vehicle_condition`),1) AS `avg_vehicle_condition`, round(avg(`ratings`.`driving_skills`),1) AS `avg_driving_skills` FROM `ratings` WHERE `ratings`.`rated_type` = 'driver' GROUP BY `ratings`.`rated_id`, `ratings`.`tenant_id` ;

-- --------------------------------------------------------

--
-- Estructura para la vista `passenger_ratings_summary`
--
DROP TABLE IF EXISTS `passenger_ratings_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `passenger_ratings_summary`  AS SELECT `ratings`.`rated_id` AS `passenger_id`, `ratings`.`tenant_id` AS `tenant_id`, count(0) AS `total_ratings`, round(avg(`ratings`.`rating`),1) AS `average_rating`, round(avg(`ratings`.`punctuality`),1) AS `avg_punctuality`, round(avg(`ratings`.`courtesy`),1) AS `avg_courtesy` FROM `ratings` WHERE `ratings`.`rated_type` = 'passenger' GROUP BY `ratings`.`rated_id`, `ratings`.`tenant_id` ;

